INSERT INTO `tbl_articles` VALUES (29,'1. Learn where to find the cheap gas.',1,'txt','It is best to avoid affluent areas when looking for a cheap fill. People in these areas are less price sensitive, and the gas stations\r\nrealize this fact. Gas at a station near major freeway exists can be more expensive than at stations farther away. It can pay to drive a\r\nfew blocks from the freeway to find a deal.',0,9,'','','',1),(30,'2. Search online or use your Smartphone.',1,'txt','There are many internet sites and apps ready to help you find the cheapest gas prices. Take the time to search for the cheapest gas before filling the tank.',1,9,'','','',1),(31,'3. Change the way you drive.',1,'txt','Many people burn much more gas than they have to. By making a few small\r\nadjustments in the way you drive, you can gain considerable fuel savings. Most vehicles today are set to achieve optimal fuel economy around 55mph. If you drive too fast or too slow, you won\'t be able to maximize your fuel savings. Also, don\'t accelerate or brake too hard - this is very hard on fuel economy.',2,9,'','','',1),(32,'4. Find the right type of station.',1,'txt','Some stations are always the price leaders in the area. Often times wholesale clubs, grocery stores or department stores with gas stations will sell gas close to cost or at a loss (loss leader), in order to get people into the stores where they may buy other, higher margin items. Some of these places require memberships. The cost of the membership must be factored into the price. Some of these stations also give you a\r\ncredit for in store purchases when you fill up with gas. This can result in considerable indirect savings. Service stations with an auto repair shop on site often have more expensive gas.',3,9,'','','',1),(33,'5. Find other ways to get to work.',1,'txt','-One of the best ways to lower your fuel cost is to carpool to work. You can reduce the inconvenience by sharing a ride with someone who works at the same company, and lives near your home. Many companies have a bulletin board or Intranet web site where you may be able to find someone to carpool with. \r\n-Another great option is public transportation. Passes are usually available at discounted rates. Although you have to pay to use public transportation, it is usually much less expensive than driving to work, and paying for parking (where applicable).\r\n-Some other options are walking or riding a bike to work. Both of these options have the added benefit of giving you exercise; however, you must live relatively close to work to be able to do this, and you are well advised to ensure that you have access to a shower at work.',4,9,'','','',1),(34,'Where can I get the printed Bus Routes?',1,'txt','Printed Bus Route timetables and maps are available at the following locations:\r\n\r\n1 Broward County libraries\r\n2 Broward Central Bus Terminal\r\n3 Broward County Governmental Center\r\n4 Most check cashing stores\r\n5 Broward County Transit Administration Office complex (Broward\r\nBoulevard and NW 1 Ave., Fort Lauderdale)\r\n6 Broward County Transit Rider Info line at 954-357-8400\r\n7 Hearing-speech impaired/TTY call (954) 357-8302 (teletype machine\r\nrequired)',0,11,'','','',1),(35,'Where can I purchase a Broward County Transit bus pass?',1,'txt','You may purchase BCT Bus Passes at many conveniently located outlets including:\r\n\r\n1 BCT Central Terminal (Broward Boulevard and NW 1 Ave., Fort Lauderdale)\r\n2 Most Broward County libraries\r\n3 Various check cashing stores\r\n4 College Bus Pass can only be purchased at the BCT Central Terminal, at selected libraries and on some College campuses.\r\n5 Premium 31-Day and Premium 10 Ride Bus Passes can only be purchased at the BCT Central Terminal\r\n6 Broward County library locations do not accept credit or debit cards for bus pass purchase.',3,11,'','','',1),(36,'What are the costs of BCT bus passes?',1,'txt','It depends on your pass. You may purchase an all day pass, 10 ride pass, 7 day pass, 31 day pass, reduced fare pass for seniors, youth, people with disabilities, Medicare and college students. You may also purchase a 95 Express Premium 10-Ride or 31-day pass.',1,11,'','','',1),(37,'Who is eligible for a reduced fare?',1,'txt','Broward County Transit offers reduced fares to make it easier for youth, seniors, college students and those with disabilities or on Medicare.',4,11,'','','',1),(38,'How do I get the Reduced Fare Photo Identification Card? What do I need to bring with me?',1,'txt','Photo sessions for the I.D. card are held at the Broward Central Terminal, Broward Boulevard and N.W. 1st Avenue, downtown Fort Lauderdale. Photos are taken and cards issued Monday thru Friday, 8:30 am to 4:30 pm.',2,11,'','','',1),(39,'What is Paratransit (TOPS)?',1,'txt','Paratransit (TOPS), also known as TOPS â€“ Transportation Options is for persons with a physical, cognitive, emotional, visual or other disability which functionally prevents them from using a Broward County Transit fixed route. To qualify, each applicant must go through an eligibility determination process.\r\n\r\nApplicants seeking ADA Paratransit (TOPS) are strongly encouraged to contact Customer Service at 954-357-8400 to discuss the eligibility criteria and other transportation options available through the TOPS program. Disability alone does not confirm eligibility for ADA Paratransit (TOPS). An in-person functional assessment is required, in most cases, to complete the eligibility process',0,12,'','','',1),(40,'If I use Paratransit (TOPS), can I use the â€œregularâ€ bus service?',1,'txt',' - Paratransit has developed a free program to help clients use the Fixed Route bus service. A professional instructor provides personal and group lessons at no charge to teach riders how to use county buses. Paratransit eligible riders can learn to travel the fixed route bus service by calling 954.357.7705.\r\n - Free Use of Fixed-Route Service\r\n - Any registered Paratransit rider with current eligibility may use the fixed-route service free of charge. The use of the fixed-route benefit will not impact Paratransit eligibility.',1,12,'','','',1),(93,'Florida KidCare',1,'txt','<div>\r\n<p align=\"center\"><strong>Affordable Health Insurance</strong></p>\r\n</div>\r\n<p>Through Florida KidCare, the State of Florida offers health insurance for children from birth through age 18, even if one or both parents are working. It includes four different parts. When you apply for the insurance, Florida KidCare will check which part your child may qualify for based on age and family income.&nbsp; <a>http://www.floridakidcare.org/</a></p>\r\n<ul>\r\n<li><a title=\"Florida Kidcare Partners\" href=\"http://www.floridakidcare.org/partners.html\" target=\"_blank\">MEDIKIDS</a>: children ages 1 through 4.</li>\r\n<li>HEALTHY KIDS: children ages 5 through 18. non-Medicaid monthly premiums</li>\r\n<li>CHILDREN&rsquo;S MEDICAL SERVICES NETWORK: children birth through 18 who havespecial health care needs.</li>\r\n<li>MEDICAID: children birth through 18. For low income or disabilities. Medical andBehaviorial Health. A child who has other health insurance may still qualify for Medicaid.</li>\r\n</ul>\r\n<p>Some of the services Florida KidCare covers are:</p>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Doctor visits</td>\r\n<td>&nbsp;Mental health</td>\r\n</tr>\r\n<tr>\r\n<td>Check-ups and shots</td>\r\n<td>Emergencies</td>\r\n</tr>\r\n<tr>\r\n<td>Hospital</td>\r\n<td>Vision and hearing</td>\r\n</tr>\r\n<tr>\r\n<td>Surgery</td>\r\n<td>Dental</td>\r\n</tr>\r\n<tr>\r\n<td>Prescriptions</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<!--[if !mso]>\r\n<style>\r\nv\\:* {behavior:url(#default#VML);}\r\no\\:* {behavior:url(#default#VML);}\r\nw\\:* {behavior:url(#default#VML);}\r\n.shape {behavior:url(#default#VML);}\r\n</style>\r\n<![endif]-->\r\n<div style=\"mso-element: para-border-div; border: none; border-bottom: solid #4F81BD 1.0pt; padding: 0in 0in 4.0pt 0in;\">\r\n<p class=\"MsoTitle\" style=\"text-align: center;\" align=\"center\"><img src=\"file:///C:\\Users\\Carlos\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image002.gif\" alt=\"Description: http://www.stepupforstudents.org/Portals/0/Resources/Images/SUFS_NewURL.png\" width=\"343\" height=\"223\" align=\"left\" hspace=\"9\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-family: \'Arial\',\'sans-serif\'; color: #365f91;\">Affordable Health Insurance</span></strong></p>\r\n</div>\r\n<!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:PixelsPerInch>72</o:PixelsPerInch>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves>false</w:TrackMoves>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <w:DoNotOptimizeForBrowser/>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSup\"/