Used=\"true\"\r\n   Name=\"List Bullet\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List Number\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List 2\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List 3\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List 4\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List 5\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List Bullet 2\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List Bullet 3\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List Bullet 4\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List Bullet 5\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Name=\"List Number 2\"/>\r\n  <w:LsdException Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\"\r\n   Na',0,30,'','','',1),(91,'What to considerâ€¦',1,'txt','<p align=\"center\"><span style=\"font-size: small;\"><strong><span style=\"text-decoration: underline;\">Rent vs. Buy Decision Making</span></strong></span></p>\r\n<p align=\"center\"><strong><em>&nbsp;&nbsp; What to consider&hellip;</em></strong></p>\r\n<ul>\r\n<li>Length of time expected to be in the area</li>\r\n<li>Renting requires a first, last and security payment</li>\r\n<li>Local prices (<em>Is it worth buying right now?)</em></li>\r\n<li>Owning a home requires a down payment</li>\r\n<li>Cost besides the mortgage of the home (<em>Insurance, taxes, home owner association fees)</em><em>&nbsp; </em></li>\r\n</ul>',0,29,'Rent_vs_buy_1.jpg','Rent vs Buy','center_top',1),(92,'Whatâ€™s your debt to income ratio??',1,'txt','<p><strong>51% &amp; above - Danger</strong><strong>! </strong>Your debt to income ratio is at an extremely high level</p>\r\n<p><strong>39%-50% - High! </strong>Your debt to income ratio is at a high level.</p>\r\n<p><strong>24%-38% - Fair! </strong>Although your debt to income ratio is at an acceptable level, you are still using a sizable amount to service debts.</p>\r\n<p><strong>16%-23% - Good! </strong>Your debt to income ratio is at a safe level. You can focus on eliminating any high interest debts.</p>\r\n<p><strong>15% &amp; below - Great!! </strong>You have a very low debt to income ratio!</p>',1,29,'Debt_to_Income_ratio.jpg','Debt to Income Ratio','center_top',1),(94,'What to provide with your application for Medicaid',1,'txt','<p>What is Medicaid? Medicaid is a state run medical assistance program for needy individuals and families with limited income.<br>Who qualifies?</p>\r\n<p>If you are under age 65 and have no children, you must be disabled to qualify for Medicaid.</p>\r\n<ul>\r\n<li>You may be disabled if you have a condition that has affected (or is expected to affect) your ability to work for at least 12 full months, or result in death.</li>\r\n<li>Children may be considered disabled if they have a medical condition severe enough to be considered a disability for an adult.</li>\r\n<li>Who decides if I am disabled? We use the same rules as Social Security to determine disability. If Social Security determines you are disabled, we accept their decision and will automatically consider you disabled. If you do not have a disability determination from Social Security, we will work with the Division of Disability Determinations (DDD) to have them evaluate your condition based on medical information you provide.</li>\r\n</ul>',0,31,'','','',1),(95,'What is the Procedure?',1,'txt','<ul>\r\n<li>Complete the application:\r\n<ul>\r\n<li>File an application online at www.myflorida.com/accessflorida or call 1-866-762-2237 for an application to be mailed .The Department of Children and Families will act on your application without regard to age, race, color, sex, disability, religious creed, national origin, marital status, or political beliefs.</li>\r\n<li>Provide Signed CF-ES 2514 form (Authorization to Disclose Information).</li>\r\n<li>Provide Medical information</li>\r\n</ul>\r\n</li>\r\n<li>Attend an Interview: Don&rsquo;t Delay! Don&rsquo;t delay your interview if you don&rsquo;t have all this information. You can provide it later or we can help you get it. Most interviews are handled by telephone.</li>\r\n<li>Every effort is made to complete your application within 90 days of the date your application for Medicaid is received, not counting any delays caused by you in getting necessary information to us.</li>\r\n<li>If your case is still pending after 100 days, your case will be reviewed to determine why there is no decision, instruct eligibility staff on what information is missing, and advise them how to obtain the missing information. If a100-day review of your case is completed, you will be sent a special notice telling you the results of the review. Your case will continue to be monitored until a final decision is made.</li>\r\n</ul>',1,31,'','','',1),(96,'What do I need to provide?',1,'txt','<ul>\r\n<li>Medical Information:\r\n<ul>\r\n<li>A copy of the letter from Social Security to show the determination of disability and the date your disability began. If Social Security determination letter is received, no other medical information is needed; otherwise medical information will be collected to determine disability eligibility.</li>\r\n<li>Proof you have applied for Social Security Disability Insurance payments.</li>\r\n</ul>\r\n</li>\r\n<li>You must have income and assets within certain limits to qualify:\r\n<ul>\r\n<li>Proof of gross monthly income from all sources,</li>\r\n<li>Information about things you own such as bank accounts, stocks, annuities, real property, cars, etc.</li>\r\n</ul>\r\n</li>\r\n<li>Proof of Florida residency</li>\r\n<li>Proof of U.S. citizenship or qualified noncitizen: Social Security number or Alien registration card, if not a U.S. citizen.</li>\r\n</ul>',2,31,'','','',1),(97,'You Are Your Childâ€™s First Teacher',1,'txt','<p>Many simple everyday occurrences provide excellent opportunities to enhance your child&rsquo;s development. Never underestimate the value of even 15 minutes of quality time spent with your child. Remember, you are your child&rsquo;s first teacher!</p>',0,32,'','','',1),(98,'Talk! Talk! Talk!',1,'txt','<p>From the time of birth, talking to your child has a big impact because language exchange is important to your child&rsquo;s language development.</p>\r\n<p>Here are some tips to encourage your child&rsquo;s use of language:</p>\r\n<ul>\r\n<li>Place a favorite toy out of reach.</li>\r\n<li>Give the child a cookie and give friend 2 cookies.</li>\r\n<li>Say rhymes and let the child fill in the rhyming word.</li>\r\n<li>Encourage counting items.</li>\r\n</ul>',1,32,'','','',1),(99,'Read! Read! Read!',1,'txt','<p>Story reading or story telling is important, as this activity helps the child know the typical pattern of events that one expects to hear in a story.</p>\r\n<p>Here are some tips to encourage your child&rsquo;s use of literacy:</p>\r\n<ul>\r\n<li>Talk about the front of the book, the top of the page. Point to words.</li>\r\n<li>Play games with sounds.</li>\r\n<li>If a book has too many words, tell the story more simply.</li>\r\n<li>Play rhyming games.</li>\r\n<li>Encourage proper pronunciation of words.</li>\r\n<li>Print names and words familiar to the child&rsquo;s environment.</li>\r\n</ul>\r\n<p>Additionally:</p>\r\n<ul>\r\n<li>Give individual attention for five or ten minutes.</li>\r\n<li>Be a good listener.</li>\r\n<li>Follow your child&rsquo;s lead for conversation and enjoyable interaction.</li>\r\n</ul>\r\n<p>When your child shows interest in the alphabet or conversation, follow your child\'s lead. Be<br>creative and use things that are funny and familiar. After all, you are your child&rsquo;s first teacher!</p>',2,32,'','','',1),(100,'Consider Your Options',1,'txt','<p>Your first question should be \"What type of care best meets my child&rsquo;s needs?\"<br>Several types are available outside the home and each offers its own benefits:</p>\r\n<ul>\r\n<li><strong>Child Care Center</strong> Care and educational activities offered to a group of children in a licensed, non-residential setting accommodating more than five children</li>\r\n</ul>\r\n<ul>\r\n<li><strong>Family Child Care Home</strong> Care and educational activities offered to a group of five children or less in the home of a person who provides the care. Licensed</li>\r\n</ul>\r\n<p><strong></strong></p>\r\n<ul class=\"_mce_tagged_br\">\r\n<li><strong>School-Age Child Care</strong> Programs for children ages 5 through 12 covering before and after school time; some offer school holiday programs and other times when school is not in session. These may be in schools, child care centers, family child care homes, youth organizations and religious organizations.</li>\r\n</ul>\r\n<ul>\r\n<li class=\"_mce_tagged_br\"><strong>Mom and Me Programs</strong> Mom and Me programs are designed to bring parents and their infants or toddlers together. Developmentally appropriate activities are offered to help parents learn more about child development in a social, supportive atmosphere.</li>\r\n</ul>\r\n<ul>\r\n<li><strong>Play Groups</strong> Play groups are part-week, part-day programs designed to give toddlers and young preschool children an opportunity for socialization. Programs may be offered by licensed child care centers, by church or temple groups, by local parks and recreation programs, or by parent groups.</li>\r\n</ul>\r\n<ul>\r\n<li><strong>Summer Camps</strong> These day camps are offered in public and private schools, child care centers, family child care homes, religious organizations and youth organizations, and through the county and municipalities. Licensing is not required</li>\r\n</ul>\r\n<ul>\r\n<li><strong>Head Start/ Voluntary Pre-Kindergarten (VPK)</strong> A high quality program with an early literacy focus. It is free for all children 4 years old on or before September 1st, who reside in Florida.</li>\r\n</ul>',0,33,'','','',1),(101,'Head Start',1,'txt','<p>Head Start is a national, federally-funded program that provides free comprehensive services for low-income preschool children and their families. These services include:</p>\r\n<ul>\r\n<li>Individualized instruction by highly qualified teachers</li>\r\n<li>Developmentally appropriate curriculum that fosters a child&rsquo;s intellectual, emotional and social growth.</li>\r\n<li>Screening and assessment</li>\r\n<li>Field trips</li>\r\n<li>Social services</li>\r\n<li>Medical and dental services</li>\r\n<li>Nutrition services</li>\r\n<li>Services for children with disabilities</li>\r\n<li>Parent involvement</li>\r\n<li>Family and community partnerships</li>\r\n</ul>',0,34,'','','',1),(102,'Eligibility Requirements and Application Procedures',1,'txt','<p>In order to be eligible for a preschool program, the following must apply:</p>\r\n<ul>\r\n<li>the child is 3 to 4 years old on or before September 1,</li>\r\n</ul>\r\n<p>AND</p>\r\n<ul>\r\n<li>family income meets low-income guidelines</li>\r\n</ul>\r\n<p>When applying, the following items are required:</p>\r\n<ul>\r\n<li>Proof of age (example: child\'s ORIGINAL birth certificate)</li>\r\n<li>Proof of ALL household income from the previous year</li>\r\n<li>Child\'s Medicaid card, if eligible</li>\r\n<li>Proof of guardianship, if applicable</li>\r\n<li>Proof of Broward County residency</li>\r\n<li>***Eligibility is based on Income and other factors, NOT on a \"First Come, First Served Basis\".</li>\r\n</ul>',1,34,'','','',1),(103,'Voluntary Pre-Kindergarten',1,'txt','<p><span style=\"text-decoration: underline;\">What is the program?</span> The Voluntary Pre-kindergarten program is designed to prepare Florida\'s children for kindergarten and develop the skills they need to become good readers and successful students. It includes standards for literacy skills, strict accountability, appropriate curricula, substantial instruction periods, manageable class sizes and qualified instructors. The Early Learning Coalition of Broward County, Inc. is administering the Voluntary Pre-kindergarten program at the local level which includes registering child care providers and providing applications and information to parents.</p>\r\n<p><span style=\"text-decoration: underline;\">What are steps to receive services?</span> When you complete the application process, you will receive a Certificate of Eligibility and a list Broward County VPK Providers. You will need to submit the Certificate of Eligibility to the provider you choose, prior to your child attending the program.</p>',2,34,'','','',1),(104,'Choosing Quality Child Care',1,'txt','<p>As a parent, no decision you make will be more important, or more difficult, than choosing a child care situation that best meets your family&rsquo;s needs. We are committed to helping parents find answers to their questions regarding how to locate <span style=\"text-decoration: underline;\">quality</span> child care and other early care and education concerns.</p>\r\n<p><br>Begin by visiting several child care homes and centers. On each visit, think about your first impression and:</p>\r\n<p><strong>Look</strong></p>\r\n<ul>\r\n<li>Does the place look safe for your child?</li>\r\n<li>Do the caregivers/teachers enjoy talking and playing with children?</li>\r\n<li>Do they talk with each child at the child&rsquo;s eye level?</li>\r\n<li>Are there plenty of toys and learning materials within the child&rsquo;s reach?</li>\r\n<li>Count ratio of adult supervision to children</li>\r\n</ul>\r\n<p><strong>Listen</strong></p>\r\n<ul>\r\n<ul>\r\n<li>Do the children sound happy and involved?</li>\r\nDo the teacher&rsquo;s voices seem cheerful and patient?</ul>\r\n</ul>\r\n<ul>\r\n<ul>A place that&rsquo;s too quiet may mean not enough activity. A place that&rsquo;s too noisy may mean there is a lack of control.</ul>\r\n</ul>\r\n<p class=\"_mce_tagged_br\"><strong>Count</strong></p>\r\n<ul>\r\n<li>Count the number of children in the group, then count the number of staff members caring for them. Obviously, the fewer the number of children to each adult, the more attention your child will receive. A small number of children per adult is most important for babies and younger children.</li>\r\n</ul>',0,35,'','','',1),(105,'Child Care Checklist',1,'txt','<p><span style=\"text-decoration: underline;\"><strong>Basics</strong></span></p>\r\n<ul>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li>License is displayed.</li>\r\n<li>Required staffing ratios are met.</li>\r\n<li>Written policies are available (including discipline policy).</li>\r\n<li>Group size is small enough to allow individual attention.</li>\r\n<li>The hours meet my needs.\r\n<p>&nbsp;</p>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><strong><span style=\"text-decoration: underline;\">Physical Facility</span></strong></p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li style=\"text-decoration: underline;\">The room is bright, cheerful, and clean.</li>\r\n<li>Enough space is provided for activities.</li>\r\n<li>Children get things themselves.</li>\r\n<li>There are enough toys, paints, books, etc. for all children.</li>\r\n<li>Equipment (chairs, tables, sinks, toilets) is all child size and in good condition.\r\n<p>&nbsp;</p>\r\n</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><strong>Staff</strong></span></p>\r\n<ul>\r\n<li style=\"list-style-type: none;\">\r\n<ul>\r\n<li>Caregivers have worked there for a year or more.</li>\r\n<li>Caregivers appear to enjoy what they do.</li>\r\n<li>Positive discipline techniques are used.</li>\r\n<li>Children are treated as individuals.</li>\r\n<li>Caregivers comfort the children when needed.</li>\r\n</ul>\r\n</li>\r\n</ul>',1,35,'','','',1),(106,'Child Safety Seat Tips and Recommendations',1,'txt','<p><strong>Fact:</strong> Motor vehicle crashes are the leading cause of death and injury for American children.<br><strong>Fact:</strong> All 50 states and the District of Columbia have passed mandatory child safety seat usage laws.</p>',0,36,'','','',1),(107,'Child Safety Seat Tips:',1,'txt','<ul>\r\n<li>The back seat is generally the safest place for a child in the event of a crash.</li>\r\n<li>Infants should ride in rear facing seat with restraints, until age 1 or 20 pounds. Read your safety seat manual for instructions regarding weight and height limits.</li>\r\n<li>Children over age 1 and 20 pounds may ride facing forward.</li>\r\n<li>The harness should be adjusted so you can slip one finger underneath the straps at your child\'s chest. The clip goes at armpit level.</li>\r\n<li>Keep your child in a safety seat with a full harness as long as possible, until they weigh at least 40 pounds.</li>\r\n<li>A belt-positioning booster seat is recommended for children between 40 to 80 pounds. It is used with the adult lap and shoulder belt.</li>\r\n</ul>',1,36,'','','',1),(108,'Parents are also reminded to:',1,'txt','<ul>\r\n<li>Avoid placing a child under age 12 in the front seat of a vehicle equipped with an air bag.</li>\r\n<li>Avoid using second-hand child safety restraints or restraints that have been involved in a crash.</li>\r\n<li>Always read carefully both the vehicle owner\'s manual and the seat manufacturer\'s instructions</li>\r\n</ul>\r\n<p>Your local Fire or Police Department has a Child Seat Safety Technician that offers free car seat installations or checks.</p>\r\n<p><em>National Highway and Safety Administration\'s \"Transportation Safety Tips\". NHTSA\'s web site: </em><a href=\"http://www.nhtsa.gov\"><em>http://www.nhtsa.gov</em></a></p>',2,36,'','','',1),(109,'Ways to Keep your Job & Get the Raise you Deserve!',0,'txt','<ol>\r\n<li><strong>Increase your Knowledge</strong> &ndash; Look for ways to increase your skills, ask for cross training. The more you know the more your job will depend on your skills</li>\r\n<li><strong>Maintain a Positive Attitude</strong> &ndash; Enjoy being at work, avoid complaining and gossiping, smile and say hello to everyone. The more people like you, the more people will value you as a worker.</li>\r\n<li><strong>Be a Good Listene</strong>r &ndash; Show your co-workers you care about what they have to say. Listen to and follow directions. The more you understand, the better you can exceed your job&rsquo;s expectations.</li>\r\n<li><strong>Show Initiative</strong> &ndash; Go the extra mile; learn to say &ldquo;How can I help&rdquo; instead of saying, &ldquo;that is not my job.&rdquo; Always look to exceed the expectation of your employer.</li>\r\n<li><strong>Demonstrate Dependability and Reliability</strong> &ndash; Arrive to work 10 minutes early, use sick days for emergencies, complete tasks before the deadline, and keep your word. This way you will always be a &ldquo;go to person.&rdquo;</li>\r\n<li><strong>Focus on Extraordinary Customer Service</strong> &ndash; Understand that the customer should always feel happy. Try to resolve the customer&rsquo;s problems. Learn how to satisfy your customer, and do not let difficult customers prevent you from providing quality services.</li>\r\n<li><strong>Demonstrate Good Problem-Solving Skills</strong> &ndash; Share your ideas of how to make it a better work place. When you present a problem offer a solution. Think about how to make the best decision based on the policies and procedures.</li>\r\n<li><strong>Be a Team Player</strong> &ndash; Understand that you will work with many different personalities. Avoid conflicts. It is ok to say you are sorry. Be willing to help your co-workers when needed.</li>\r\n<li><strong>Understand your Role</strong> &ndash; Know what is expected of you and exceed those expectations. Read your job description. Ask what your boss expects from you. Review evaluations tools.</li>\r\n<li><strong>Follow the Employer&rsquo;s Policies and procedures</strong> &ndash; Understand how to perform your job based on the company&rsquo;s policies. Complete tasks based on the set procedures. Ask clarifying questions when you do not understand a procedure.</li>\r\n</ol>',0,37,'keep_your_job.jpg','keep_your_job','right',1),(110,'Finding Career Direction',1,'txt','<p>How long has it been since you asked yourself what you want to be when you grow up?</p>\r\n<p>If you haven\'t considered the idea since high school, then you may have settled into a job that is not fulfilling your professional aspirations, or your purpose.</p>\r\n<p>Each of us has particular talents that, when expressed or exercised, make the world a better place. Most likely you enjoy doing these things, and you find that people respond well to you when you do them. Perhaps&nbsp; they\'re things you gravitate towards during out-of-office-hours activities, and talents people respect you for.</p>',0,38,'career direction.jpg','career','right',1),(111,'Your Career Direction Journey',1,'txt','<ul>\r\n<li>The process of uncovering what you are meant to do, that is finding career direction, is a journey. It starts with discovering the essential \"you\": the person who truly resides behind the facades, defenses, and stresses of everyday life.</li>\r\n<li>Once unmasked, your journey continues with specific career exploration and identification of a career that allows you to make good use of your talents. And it moves on with a focused job or career move, in which you identify the jobs you want and put yourself in the best possible position to get them. In fact, this journey never really ends because work itself is all about change, growth, development, and reinvention.</li>\r\n<li>By taking a talent-based approach to your career search right from the start, you keep yourself heading toward the right career even when the actual direction shifts over time.</li>\r\n</ul>',1,38,'','','',1),(112,'This approach consists of sequentially answering three questions:',1,'txt','<ol>\r\n<li>Who Am I?<ol>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n</ol></li>\r\n<li>What Do I Want to Do?<ol>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n</ol></li>\r\n<li>How Do I Get Hired?<ol>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n<li>_________________________________</li>\r\n</ol></li>\r\n</ol>',0,39,'who_am_i.jpg','who_am_i','right',1),(113,'Who Am I?',1,'txt','<ul>\r\n<li>The first question to answer is \"Who am I?\"</li>\r\n<li>When have you been most committed, passionate and enthusiastic?</li>\r\n<li>What do you consider to be your greatest accomplishment?</li>\r\n<li>For what would you take a very strong stand?</li>\r\n<li>What about the world puzzles or disturbs you that you could make an impact on?</li>\r\n<li>What jobs do you like to do at work when you have a choice?</li>\r\n<li>What activities are you drawn towards out of work?</li>\r\n<li>If money were no concern, what would you be doing?</li>\r\n</ul>\r\n<p>Brainstorm each of these questions, and then use your answers to identify the top 3 talents<br>that you most use when you\'re successful. Rank these in order.</p>',1,39,'','','',1),(114,'My Top 3 Talents',1,'txt','<ol>\r\n<li>_____________________________</li>\r\n<li>_____________________________</li>\r\n<li>_____________________________</li>\r\n</ol>',2,39,'','','',1),(115,'What Do I Want to Do?',1,'txt','<p>Now that you know who you are, the next stage is to think about what you want to do. Do any of the<br>listed industries interest you?</p>',0,40,'','','',1),(116,'Key Points',1,'txt','<ul>\r\n<li>Finding career direction is a process. The more effort you put into the planning stages the better your&nbsp; results. Uncovering your true self and your purpose is heavy, emotional work and you may have to go</li>\r\n<li>through this process a few times in the span of your working life. The effort however, is certainly worth it when you end up with a clear sense of the direction your career should be taking.</li>\r\n<li>The more contingency plans you have, the more likely you will be able to survive the inevitable setbacks. You will also have much more confidence in yourself despite the bumps in the road.&nbsp;</li>\r\n<li>Recognize that the more opportunities you have, the better the job that you\\\'ll be able to choose. Concentrate on creating as many opportunities as possible!</li>\r\n<li>Now you are free to pursue your dream career with confidence. There are certainly no guarantees but with the right amount of planning and a sufficient dose of reality, the career that you are meant for will materialize.</li>\r\n</ul>',1,40,'key_point.jpg','key_point','right',1),(117,'Post-Secondary Education',1,'txt','<ul>\r\n<li>Post-secondary education refers to all education that follows high school, and so it is often optional. Undergraduate, postgraduate and vocational schools make up the various types of postsecondary education.</li>\r\n</ul>\r\n<p>&nbsp;</p>',0,41,'post_seconday.jpg','post_secondary','right',1),(118,'Undergraduate Schools',1,'txt','<ul>\r\n<li>Undergraduate schools are often just called college, and are the most common schools for a student graduating high school to attend. These typically take two to four years to complete. In the U.S., an undergraduate degree will earn you an Associates (A.S) or (A.A) or Bachelor of Science (B.S.) or a Bachelor of Arts (B.A.) degree, depending on which course of study you choose to pursue.</li>\r\n</ul>',1,41,'','','',1),(119,'Postgraduate Schools',1,'txt','<ul>\r\n<li>A postgraduate degree is often earned at a university, and it can sometimes be earned at the same college where you earned your undergraduate Bachelor\'s degree. Attending a school for a postgraduate degree in the United States allows you to earn a master\'s degree in any number of subjects including master&nbsp; of fine arts (MFA), master of business administration (MBA), and master\'s of education (M.Ed.), to include some of the more common degrees.</li>\r\n</ul>',2,41,'post_graduate.jpg','post_graduate','right',1),(120,'Vocational/Technical Schools',1,'txt','<ul>\r\n<li>Learning trades is done at vocational school. These are also called trade schools or career colleges. These schools are different from other types of schooling after high school in that they focus more on preparing you for a particular job. Examples of vocational type schools include dental school, veterinary school, and various schools that train for jobs involving computers. Some of these schools may require a previous undergraduate degree.</li>\r\n</ul>\r\n<p>&nbsp;</p>',3,41,'average_salary.jpg','average_salary','right',1),(121,'Terminal Degrees',1,'txt','<ul>\r\n<li>Some degrees are referred to as \"terminal\" because they are the furthest degree you can get in a particular field of post-secondary education. An example is the doctorate. Doctoral degrees allow you to put \'Dr.\' before your name, even if the degree is not in the medical field. Literature, psychology, and history are some examples of fields you can receive a doctorate in. Some fields more associated with practice than theory, such as creative writing or acting, offer a master of fine arts as a terminal degree.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>Read more: Post-Secondary Education Definition | eHow.com<br>http://www.ehow.com/about_4793321_post_secondary-education-definition.html#ixzz1z7ADvZ00</p>',4,41,'','','',1),(122,'Essential Elements of Job Search',1,'txt','<ul>\r\n<li>Job Search Techniques &amp; Resources</li>\r\n<li>Cover Letter/ R&eacute;sum&eacute;</li>\r\n<li>The Job Interview</li>\r\n</ul>',0,42,'how_do_i_get_started.jpg','how_do_i_get_started','right',1),(123,'Start by writing down the career you want.',1,'txt','<p>For each of these steps create a detailed implementation plan.</p>\r\n<p><br>What is your long-term vision for yourself in terms of your career?</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>Write down the steps you need to take or the things you need to accomplish, in order to get there.</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________<br>What qualifications should you get?</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>What experience should you build?</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>Which organization will give you the best start?</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>\r\n<p>__________________________________________________________________________________________________</p>',1,42,'','','',1),(124,'Making Yourself the Best Candidate',1,'txt','<ul>\r\n<li>Research the organization.</li>\r\n<li>Research the job.</li>\r\n<li>Familiarize yourself with the job description.</li>\r\n<li>Match your skills &amp; experience to the position.</li>\r\n<li>Know yourself.</li>\r\n<li>Project a positive attitude.</li>\r\n<li>Keep in touch with your contacts periodically.</li>\r\n<li>Write thank you notes and follow up after interview.</li>\r\n</ul>',0,43,'best_candidate.jpg','best_candidate','right',1),(125,'Cover letter',1,'txt','<p>Cover Letter - a letter sent with your resume when applying for jobs. It provides additional information on your skills and experience and highlights qualifications on your resume.</p>',1,43,'','','',1),(126,'RÃ©sumÃ© Tips:',1,'txt','<ul>\r\n<li>Keep it short.</li>\r\n<li>Use a quality printer.</li>\r\n<li>Omit negative details.</li>\r\n<li>Do not include personal information.</li>\r\n<li>Proofread!</li>\r\n<li>Offer to provide references.</li>\r\n</ul>',2,43,'resume_tips.jpg','resume_tips','left',1),(127,'Types of RÃ©sumÃ©s',1,'txt','<p><strong>Chronological</strong> &ndash; Chronological listing of jobs with most recent mentioned first.<br><strong>Functional</strong> &ndash; Highlights skills, talents, achievements and experience as they relate to the type of employment you seek rather than emphasizing work history.<br><strong>Combination</strong> &ndash; Focuses on skills and abilities as well as work history.</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\">Your Name<br>Address â— City, State, Zip Code â— Phone Number â— Email Address</p>\r\n<p style=\"text-align: left;\"><br>Personal Profile (Enter academic achievements, career goals, etc.)<br>â—<br>â—<br>â—<br>Education<br>School Name &ndash; School City, State<br>Degree expected, degree expected date<br>â—<br>â—<br>Experience<br>Professional Experience<br>Company name, dates of employment<br>Job description, responsibilities and accomplishments<br>â—<br>â—<br>Internship<br>Company name, dates of employment<br>Job description, responsibilities and accomplishments<br>â—<br>â—<br>Volunteer Experience<br>Company name, dates of volunteer service<br>Service description, responsibilities and accomplishments<br>â—<br>â—<br>Activities (List sports, clubs, etc. as well as dates of involvement)<br>â—<br>â—<br>â—</p>',0,44,'','','',1),(128,'Preparing for the Interview',1,'txt','<ul>\r\n<li>Do some research about the company and the position you are applying for.</li>\r\n<li>PRACTICE, PRACTICE, PRACTICE. Anticipate questions you might be asked beforehand and practice interviewing.</li>\r\n<li>Make a good first impression &ndash; dress appropriately, firm handshake, positive attitude and be on time.</li>\r\n<li>Adopt the employer&rsquo;s perspective when answering questions.</li>\r\n<li>Be able to answer the questions: What can you offer us? Why should we hire you? What distinguishes you from others?</li>\r\n<li>Ask questions if you are unsure of what you&rsquo;re being asked.</li>\r\n<li>Discuss experiences that relate to the position you are seeking.</li>\r\n<li>Ask the employer questions that demonstrate genuine interest in the position or company.</li>\r\n<li>Follow up &ndash; Ask for a business card and write a thank you letter.</li>\r\n</ul>',0,45,'preraring_for_reume.jpg','preparing','center_bottom',1),(129,'Got that Entrepreneurial Spirit?',1,'txt','<p>It takes more than a good idea and a desire to be your own boss to launch a successful venture. Follow these tips to increase your odds of success.</p>\r\n<table border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p>1. Do you know how to operate a<br>computer?</p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n</td>\r\n<td>\r\n<p>4. If not, do you know how to set up an<br>email account and/or use the internet?</p>\r\n<p>_____________________________________</p>\r\n<p>_____________________________________</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2. Do you have access to a computer with<br>internet capability? If so, how?</p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n</td>\r\n<td>\r\n<p>5. Do you know how to use Word, Excel<br>and other software?</p>\r\n<p>_____________________________________</p>\r\n<p>_____________________________________</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3. Do you have an email account? If so,<br>what is it? Do you use it?</p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n<p>______________________________________&nbsp;&nbsp; </p>\r\n</td>\r\n<td>\r\n<p>6. Do you have a business idea? If no,<br>have you thought about franchising?</p>\r\n<p>_____________________________________</p>\r\n<p>_____________________________________</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Please describe your business idea (purpose and operation)</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>\r\n<p>_____________________________________________________________________________________________________</p>',0,46,'','','',1),(130,'Sample: Work flow for a construction company',1,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Sample: Work flow for a construction company</strong></span></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<table border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\">Contact Customer ----&gt;</td>\r\n<td style=\"text-align: center;\">\r\n<p>Visit Job Site</p>\r\n<p>&nbsp;----&gt;</p>\r\n</td>\r\n<td style=\"text-align: center;\">Estimate Job ----&gt;</td>\r\n<td style=\"text-align: center;\">Write Order ----&gt;</td>\r\n<td style=\"text-align: center;\">\r\n<p>Gather Materials</p>\r\n<p>----&gt;</p>\r\n</td>\r\n<td style=\"text-align: center;\">Perform Work ----&gt;</td>\r\n<td style=\"text-align: center;\">Follow Up ----&gt;</td>\r\n<td style=\"text-align: center;\">Collect Fee</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>',0,47,'','','',1),(131,'Draw your own flow chart.',1,'txt','<p>Use the space below to draw a flow chart of all the steps needed for your business to operate.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',1,47,'','','',1),(133,'You may be eligible for Unemployment Compensation',1,'txt','<p>Unemployment Compensation (also called unemployment insurance) provides temporary wage replacement benefits to qualified individuals who are out of work thru no fault of their own.</p>',0,48,'lost_job_1.jpg','lost_job','right',1),(132,'Tips to help a small business survive',1,'txt','<ul>\r\n<li>Step 1: Understand accounting.</li>\r\n<li>Step 2: Reduce overhead.</li>\r\n<li>Step 3: Make it work.</li>\r\n<li>Step 4: Barter for services.</li>\r\n<li>Step 5: Get the word out.</li>\r\n<li>Step 6: Build a winning team.</li>\r\n</ul>',2,47,'small_business.jpg','small_business','right',1),(134,'Do I qualify?',1,'txt','<p>In order to qualify for benefits, you must:</p>\r\n<ul>\r\n<li>Have lost your job through no fault of your own</li>\r\n<li>Be actively looking for a new job</li>\r\n<li>Be ready to take a new job when offered</li>\r\n<li>Meet wage requirements based on your previous jobs</li>\r\n</ul>',1,48,'','','',1),(135,'How do I apply?',1,'txt','<p>The best way to file a claim is:</p>\r\n<ul>\r\n<li>Online at www.floridajobs.org . Click on the &ldquo;File for unemployment&rdquo; button and follow the directions.</li>\r\n<li>If you don&rsquo;t have internet access, you can file over the phone. Please direct your call to 211 for further assistance</li>\r\n</ul>',2,48,'','','',1),(136,'What is the next step?',1,'txt','<ul>\r\n<li>If you file online, you will receive a confirmation number and instructions on what actions to take and how to claim your benefits.</li>\r\n<li>If you file by phone, you will be instructed on how to claim your benefits through the automated certification process online or via phone</li>\r\n</ul>',3,48,'','','',1),(137,'What to expect.',1,'txt','<ul>\r\n<li>It typically takes three to four weeks to get your first check</li>\r\n<li>After you file your claim, you will need to certify every two weeks either online or over the phone that you are looking for a new job</li>\r\n<li>Help is available to find a new job at your local One &ndash; Stop Career Center and through Florida&rsquo;s job &ndash; matching and workforce resource website, <a title=\"Employ Florida\" href=\"http://www.employflorida.com\" target=\"_blank\">www.employflorida.com</a></li>\r\n</ul>',4,48,'','','',1),(139,'Let\'s eat for the health of it!',0,'txt','<p><strong>Let\'s eat for the health of it!</strong><strong> Build a healthy plate</strong></p>\r\n<p><strong><em>&nbsp;Choose a change that you can make today, and move toward a healthier you.</em></strong></p>\r\n<ul>\r\n<li><strong>Make healthy food choices</strong><ol>\r\n<li><em>Make at least half your grains whole grains.</em></li>\r\n<li><em>Make half your plate fruits and vegetables.</em></li>\r\n<li><em>Vary your veggies.</em></li>\r\n<li><em>Focus on fruit.</em></li>\r\n<li><em>Get your calcium rich foods.</em></li>\r\n</ol></li>\r\n<li><strong>Keep food safe to eat.</strong></li>\r\n<li><strong>Find your balance between food and physical activity.</strong></li>\r\n</ul>\r\n<p><strong>&nbsp;</strong><em>Your food and physical activity choices each day affect your health &ndash; how you feel today, tomorrow, and in the future. These tips and ideas are a starting point.&nbsp; You will find a wealth of suggestions here that can help you get started toward a healthy diet.&nbsp; </em></p>',0,50,'my_plate.jpg','my_plate','right',1),(185,'Grains',0,'txt','<p><strong>Grains:</strong></p>\r\n<p>Any food made from wheat, rice, oats, cornmeal, barley or another cereal grain is a grain product. Bread, pasta, oatmeal, breakfast cereals, tortillas, and grits are examples of grain products.</p>\r\n<p>Grains are divided into 2 subgroups, whole grains and refined grains:</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Create your own menu:</strong></p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>1 </strong>Whole grains can be healthy snacks.</p>\r\n<p>Popcorn, a whole grain, can be a healthy snack. Make it with little or no added salt or butter.</p>\r\n<p><strong>2 </strong>Bake up some whole-grain goodness.</p>\r\n<p>Experiment by substituting buckwheat, millet, or oat flour for up to half of the flour in pancake, waffle, muffin, or other flour-based recipes. They may need a bit more leavening in order to rise.</p>\r\n<p><strong>3 </strong>Check the label for fiber.</p>\r\n<p>Use the Nutrition Facts label to check the fiber content of whole-grain foods. Good sources of fiber contain 10% to 19% of the Daily Value; excellent sources contain 20% or more.</p>',1,50,'grains.jpg','grains','center_top',1),(143,'Empty Calories',0,'txt','<p><strong>Empty Calories</strong><br>Many of the foods and beverages Americans eat and drink contain empty calories &ndash; calories from solid fats and/or added sugars. Solid fats and added sugars add calories to the food but few or no nutrients.</p>\r\n<p>&nbsp;</p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>Food with some empty calories</strong></td>\r\n<td style=\"text-align: center;\"><strong>Food with few or no empty calories</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Sweetened applesauce (added sugars)</td>\r\n<td style=\"text-align: center;\">Unsweetened applesauce</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Regular ground beef (75% lean) (solid fats)</td>\r\n<td style=\"text-align: center;\">Extra lean ground beef (90% or more lean)</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Fried chicken (solid fats from frying and skin)</td>\r\n<td style=\"text-align: center;\">Baked chicken breast without skin</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Sugar-sweetened cereals (added sugars)</td>\r\n<td style=\"text-align: center;\">Unsweetened cereals</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Whole milk (solid fats)</td>\r\n<td style=\"text-align: center;\">Fat-Free milk</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li><span style=\"font-size: small;\">Before you eat, think about what goes on your plate or in your cup or bowl. Foods like vegetables, fruits, whole grains, low-fat dairy products, and lean protein foods contain the nutrients you need without too many calories.</span></li>\r\n<li><span style=\"font-size: small;\">Solid fats are fats that are solid at room temperature, like butter. Added sugars are sugars and syrups that are added when foods or beverages are processed or prepared.</span></li>\r\n</ul>\r\n<table style=\"width: 430px; height: 124px;\" border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>Food I should avoid</strong></td>\r\n<td style=\"text-align: center;\"><strong>Food I would eat</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Cakes, cookies pastries and donuts</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Sodas, energy drinks, sports drinks, and fruit drinks</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Pizza (solid fat)</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Ice cream (both solid fat and added sugars)</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">\r\n<p>Sausages, hotdogs, bacon and ribs (contain solid fat)</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>',0,53,'','','',1),(144,'Food Safety',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Food Safety</strong></span></p>\r\n<p><strong>Separate: </strong>Don\'t Cross Contaminate</p>\r\n<p>Cross-contamination is how bacteria can be spread.</p>\r\n<ul>\r\n<li>When handling raw meat, poultry, seafood, and eggs, keep these foods and their juices away from ready-to-eat foods.</li>\r\n</ul>\r\n<ul>\r\n<li>Wash cutting boards, dishes, countertops, and utensils with hot soapy water.</li>\r\n<li>Separate raw meat, poultry, seafood, and eggs from other foods in your grocery shopping cart, grocery bags, and in your refrigerator.</li>\r\n<li>Use one cutting board for fresh produce and a separate one for raw meat, poultry, and seafood.</li>\r\n<li>Use a food thermometer, to make sure that the food is cooked to a safe internal temperature.</li>\r\n</ul>\r\n<p>&nbsp;</p>',0,54,'','','',1),(188,'Cook to Proper Temperatures',0,'txt','<p><strong>Cook: Cook to Proper Temperatures</strong></p>\r\n<p>Food is safely cooked when it reaches a high enough internal temperature to kill the harmful bacteria that cause foodborne illness.</p>',1,54,'food_safety.jpg','food_safety','center_bottom',1),(189,'Refrigerate Promptly!',0,'txt','<p><strong>Chill: Refrigerate Promptly!</strong></p>\r\n<p>Refrigerate foods quickly because cold temperatures slow the growth of harmful bacteria. Cold air must circulate to help keep food safe. Keeping a constant refrigerator temperature of 40&deg;F or below is one of the most effective ways to reduce the risk of foodborne illness. The freezer temperature should be 0&deg;F or below.</p>\r\n<ul>\r\n<li>Refrigerate or freeze meat, poultry, eggs, and other perishables as soon as you get them home from the store.</li>\r\n<li><strong><em>Never</em></strong><em> let raw meat, poultry, eggs, cooked food, or cut fresh fruits or vegetables sit at room temperature <strong>more than two hours</strong></em>.</li>\r\n<li>Food must be kept at a safe temperature during thawing. <strong>There are three safe ways to defrost food:</strong> <em>in the refrigerator, in cold water, and in the microwave using the defrost setting. </em>Always marinate food in the refrigerator</li>\r\n</ul>',2,54,'chill.jpg','chill','right',1),(145,'Eating Healthy on a Budget',0,'txt','<p><span style=\"font-size: medium;\"><strong>Eating Healthy on a Budget</strong></span></p>\r\n<ul>\r\n<li><span style=\"font-size: x-small;\"><strong>Learn to cook</strong>. Youcan eat a lot cheaper by learning to cook and eating at home. Make it fun by cooking with friends</span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Cut back on prepackaged,preprepared food</strong>. Single-serve packages are more expensive.</span></li>\r\n<li><strong>Buy food and supplies in bulk</strong>. Check out your local grocery stores and bulk retailers for the best buys.</li>\r\n<li><strong>Use your freezer.</strong> Cook in large quantities and freeze your leftovers for another day. It&rsquo;s great to come home, grab a frozen leftover and pop it in the microwave. Voila! Hot food.</li>\r\n<li><strong>Buy generic.</strong></li>\r\n<li><strong>Drink water.</strong> Carry a refillable water bottle with you. Avoid buying sodas and snacks out of vending machines</li>\r\n<li><strong>Set a budget for snack items and then buy your snacks at the grocery store.</strong> Be sure to bring snacks with you when you leave your home.</li>\r\n<li><strong>Try different stress busters.</strong> Many people turn to food-especially gooey, fatty kinds &ndash; when stress levels go up. Develop other stress busters that can work for you with minimal calories and<br>cost, such as a brisk walk, a workout, or tea with a friend.</li>\r\n<li><strong>Plan ahead.</strong> Does your resolve to eat better weaken when your schedule is hectic? Take healthy snacks such as fruit and nuts with you on busy days.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',0,55,'eating_healthy.jpg','eating_healhty','left',1),(190,'How to save when buying groceries',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>How to save when buying groceries</strong></span></p>\r\n<ol start=\"1\">\r\n<li><strong>Buy items on sale</strong>.&nbsp; Look for the Buy One Get One Free items.</li>\r\n<li><strong>Use coupons</strong> (newspaper and internet).</li>\r\n<li><strong>Make a list</strong> (try to stick to it).</li>\r\n<li>When buying fruits and vegetables consider visiting your <strong>local farmer&rsquo;s market.</strong></li>\r\n<li><strong>Do NOT shop when you are hungry.</strong></li>\r\n<li><strong>Avoid purchasing non-grocery items at the grocery store</strong> (i.e. hair products, cleaning products, etc.).</li>\r\n<li><strong>Try store brands</strong> (sometimes they taste better than the name brand).</li>\r\n</ol>\r\n<p><strong>Stay away from prepared meals</strong>. Often these meals are more expensive than preparing your own meals</p>',1,55,'save_when_buying.jpg','save_when_buying','right',1),(146,'Do you need help with food?',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Do you need help with food?</strong></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">You may want to consider looking for your local food pantry or congregate meal option. Both a food<br>pantry and a congregate meal may help you with your food needs. You may decide to use both or<br>choose to use only one.</span></span></p>\r\n<ul>\r\n<li><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Food Pantry: A food pantry helps meet the needs of hungry people in our community bysupplying groceries to those in need. Often a food pantry provides a free, three to five day<br>supply of emergency groceries for qualified individuals and families.</span></span><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><br><br></span></span></li>\r\n<li><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Congregate/Community: Meals include soup kitchens and senior dining rooms.<br>The congregate meal is a place where hot food is offered to the hungry for free or minimal cost.<br>Senior dining rooms also offer social time with activities.</span></span></li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline; font-size: small;\"><em><strong>Additional food options:</strong></em></span></p>\r\n<ul>\r\n<li><strong>Home delivered meals:</strong> If you are a homebound senior or person with disabilities, you may<br>be eligible for home delivered meals.</li>\r\n<li><strong>Emergency meals:</strong> One time service for seniors just coming home from the hospital or<br>those who suddenly find themselves in need of immediate assistance.</li>\r\n<li><strong>Grocery shopping:</strong> Available to seniors who are able to pay for their own groceries but are<br>unable to shop for themselves.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',0,56,'','','',1),(191,'WIC',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>WIC</strong></span></p>\r\n<p>Florida WIC is the special supplemental nutrition program for Women, Infants, and Children.&nbsp; The program provides a combination of supplemental nutritious foods, nutrition education, breastfeeding promotion and support, and referrals for health care, immunizations, and community services to eligible participants.</p>',1,56,'wic.jpg','wic','left',1),(192,'Who is eligible for WIC?',0,'txt','<p><strong><em><span style=\"text-decoration: underline;\">Who is eligible for WIC?</span></em></strong></p>\r\n<ul>\r\n<li>Pregnant and breastfeeding women, women who have recently been pregnant, infants and children under the age of 5 years who have a low or moderate income, are at nutrition risk, and who live in Florida.&nbsp; A person is considered income-eligible for WIC if the household income is less than or equal to those listed in the WIC Income Guidelines or if the person is currently receiving Medicaid, Temporary Cash Assistance (TCA) or Food Assistance. However a person DOES NOT have to be on a public assistance program to qualify for WIC.</li>\r\n</ul>\r\n<p><strong><em><span style=\"text-decoration: underline;\">Applying for WIC:</span></em></strong></p>\r\n<ul>\r\n<li>The local WIC office will give you a date and time for a WIC certification visit.&nbsp; At this visit, the household income and the medical/nutrition status of each applicant will be reviewed.&nbsp; On that day, you will find out if you and your children are eligible for WIC.</li>\r\n</ul>\r\n<p><strong><em><span style=\"text-decoration: underline;\">&nbsp;</span></em></strong></p>\r\n<p><strong><em><span style=\"text-decoration: underline;\">What food does WIC provide?</span></em></strong></p>\r\n<ul>\r\n<li>WIC provides food rich in certain key nutrients.&nbsp; Women and children enrolled in the WIC program receive food checks for a variety of foods such as milk, cheese, eggs, cereals, peanut butter or dry beans, and 100% fruit and vegetable juices.&nbsp; Women who are exclusively breastfeeding their babies receive additional cheese, juice and dry beans, as well as carrots and canned tuna fish. Infants who are not breastfed receive the WIC contract brand of infant formula for the first year of life.&nbsp; Beginning at 6 months of age, infants may also receive infant cereal and fruit juice.&nbsp; Special formulas or nutritional supplements are also available to participants with certain medical conditions.</li>\r\n</ul>',2,56,'wic_food.jpg','wic_food','right',1),(147,'WIC / FREE or REDUCED Meals at School',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>FREE or REDUCED Meals at School</strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"text-decoration: underline;\"><em><strong>Who can get free meals?</strong></em></span></p>\r\n<ul>\r\n<li style=\"text-align: left;\">All children in households receiving benefits from Florida SNAP, Florida TANF or the FDPIR (Food Distribution Program on Indian Reservations), can get free meals regardless of your income. Also, children in households participating in WIC may be eligible for free or reduced price meals.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>Can homeless, migrant, runaway and foster children get free</strong></em></span><br><span style=\"text-decoration: underline;\"><em><strong>meals?</strong></em></span></p>\r\n<ul>\r\n<li>Yes, children who meet the definition of homeless, migrant, runaway or foster children under the legal responsibility of a foster care agency or court are eligible for free meals.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>My child&rsquo;s application was approved last year; do I need to fill out another one?</strong></em></span><br><br></p>\r\n<ul>\r\n<li>Yes. Your child&rsquo;s application is only good for that school year and for the first few days of this<br>school year. You must send in a new application unless the Food and Nutrition Office told<br>you that your child is eligible for the new school year.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>If I don&rsquo;t qualify now, may I apply later?</strong></em></span></p>\r\n<ul>\r\n<li>Yes, you may apply at any time during the school year. For example, children with a parent<br>or guardian who becomes unemployed may become eligible for free or reduced price meals<br>if the household income drops below the income limit.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>What if I disagree with the Food and Nutrition Office&rsquo;s decision about my application?</strong></em></span></p>\r\n<ul>\r\n<li>You should talk to an official at the Food and Nutrition Office.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',0,57,'free_meal.jpg','free_meal','right',1),(195,'Qustion 1',0,'txt','<p>1. Hands should be washed with water and soap for at least:</p>\r\n<p>a. 5 Seconds</p>\r\n<p>b. 20 Seconds</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',1,60,'wash_hands.jpg','wash_hands','right',1),(196,'Question 2',0,'txt','<p>2. Food should not be left at room temperature for more than:</p>\r\n<p>a. 2 hour</p>\r\n<p>b. 10 hour</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',2,60,'food_temp.jpg','food_temp','right',1),(197,'Question 3',0,'txt','<p>3. The only way to be sure foods are cooked long enough to kill harmful bacteria is to:</p>\r\n<p>a. Use a food Thermometer</p>\r\n<p>b. Use a timer</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',3,60,'food_temp.jpg','food_temp','right',1),(198,'Question 4',0,'txt','<p>4. Is it safe to put cooked food on a plate that held raw meat, poultry or seafood?</p>\r\n<p>a. Yes</p>\r\n<p>b. No</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: right;\">Answers:&nbsp; 1. b 2. a 3. a 4. b</p>',4,60,'food_cutboard.jpg','food_cutboard','right',1),(148,'Food Assistance and SUNCAP:',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Food Assistance and SUNCAP</strong></span></p>\r\n<p>The SUNCAP Program is a special Food Assistance Program for individuals who receive Supplemental<br>Security Income (SSI). You may be eligible to receive food assistance benefits through the SUNCAP<br>Program without any additional application, paperwork, or interviews. If you already receive food<br>assistance benefits in the regular Food Assistance Program, you may be automatically put in the<br>SUNCAP Program when you become SSI eligible. If your food assistance benefits go down because<br>of SUNCAP, you may choose to continue receiving your food assistance under the regular Food<br>Assistance Program.</p>\r\n<p>&nbsp;</p>',0,58,'suncap.jpg','suncap','right',1),(193,'S.N.A.P.',0,'txt','<p style=\"text-align: center;\"><strong>The new name for the Food Stamp Program is now the Supplemental Nutrition Assistance Program (SNAP)</strong></p>\r\n<p style=\"text-align: left;\"><strong>How can you find out if you may be eligible?</strong></p>\r\n<ul>\r\n<li style=\"text-align: left;\">The Food Assistance Program helps people with low-income buy healthy food. A food<br>assistance household is normally a group of people who live together and buy food and cook<br>meals together. If your household passes the Food Assistance Program\'s eligibility rules, the<br>amount of food assistance benefits you get depends on the number of people in your<br>household and how much money is left after certain expenses are subtracted.</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>Eligibility Requirements</strong></em></span></p>\r\n<p>Individuals must pass all eligibility rules to get food assistance benefits. Some of the eligibility rules<br>are:</p>\r\n<ul>\r\n<li><strong>Identity</strong> - Applicants must provide proof of their identity.</li>\r\n<li><strong>Work Rules</strong> - Healthy adults, 18 to 50 years of age, who do not have dependent children or<br>are not pregnant, can only get food assistance benefits for 3 months in a 3-year period, if<br>they are not working or participating in a work or work force program.</li>\r\n<li><strong>Income and Deductions</strong> &ndash; Most households must pass a gross income limit at 200% of the<br>Federal Poverty Level (FPL).</li>\r\n<li><strong>Residency</strong> - Individuals must live in the state of Florida.</li>\r\n<li><strong>Citizenship</strong> - Individuals must be a U.S. citizen or have a qualified noncitizen status</li>\r\n<li><strong>SSN</strong> - Individuals must provide a Social Security Number or proof they have applied for one</li>\r\n<li><strong>Child Support Cooperation</strong> - Certain individuals must cooperate with the state\'s child<br>support enforcement agency to prove a child\'s legal relationship to their parent and to get the<br>court to order child support payments</li>\r\n<li><strong>Assets</strong> - Most food assistance households may have assets such as vehicles, bank<br>accounts, or property and still get help. Households with a disqualified member must meet an<br>asset limit of $2,000 or $3,250 effective October 1, 2011(if the household contains an elderly<br>or disabled member).</li>\r\n</ul>\r\n<p><span style=\"text-decoration: underline;\"><em><strong>Foods You Can Buy With Food Assistance Benefits</strong></em></span></p>\r\n<ul>\r\n<li>Households can use food assistance benefits to buy breads, cereals, fruits, vegetables,meats, fish, poultry, dairy, and plants and seeds to grow food for your household to eat.Households cannot use food assistance benefits to buy nonfood items such as pet foods,soaps, paper products, household supplies, grooming items, alcoholic beverages, tobacco,vitamins, medicines, food to eat in the store, or hot foods.</li>\r\n</ul>',1,58,'snap.jpg','snap','left',1),(149,'5 Myths & Facts about Food Stamps for the Elderly',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>5 Myths &amp; Facts about Food Stamps for the Elderly</strong></span></p>\r\n<p><span style=\"font-size: small;\">1. <strong>MYTH: Food stamps are welfare.</strong></span><br><span style=\"font-size: small;\"><strong>FACT:</strong> The Food Stamp Program is a nutrition assistance program, now called SNAP (Supplemental Nutrition Assistance Program), to help low income people buy nutritious food.</span></p>\r\n<p><br><span style=\"font-size: small;\">2.<strong> MYTH: Elderly people only receive a few dollars a month in food stamps.</strong></span><br><span style=\"font-size: small;\"><strong>FACT</strong>: $16 is the smallest amount of food stamps you can get and the average for the elderly is much higher.</span></p>\r\n<p><br><span style=\"font-size: small;\">3. <strong>MYTH: Elderly people cannot own a home and if they do, it will be taken away.</strong></span><br><span style=\"font-size: small;\"><strong>FACT:</strong> Anyone can own or buy a home and still get food stamps. The Food Stamp Program does not require anyone to give up their home or any assets.</span></p>\r\n<p><br><span style=\"font-size: small;\">4. <strong>MYTH: Elderly people must go to the food stamp office to apply for assistance.</strong></span><br><span style=\"font-size: small;\"><strong>FACT:</strong> It is not necessary to go to an office. There are many local organizations that help people apply online. To find a partner near you, please call &ldquo;2-1-1&rdquo;.</span></p>\r\n<p><br><span style=\"font-size: small;\">5.<strong> MYTH: Elderly people do not get a credit for medical bills</strong>.</span><br><span style=\"font-size: small;\"><strong>FACT:</strong> Medical bills may be deducted unless an insurance company</span><br><span style=\"font-size: small;\">pays them.</span></p>\r\n<p><span style=\"font-size: small;\">&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>5 Myths and Facts about Food Stamps &amp; </strong></span><span style=\"font-size: small;\"><strong>Immigrants</strong></span></p>\r\n<p><span style=\"font-size: small;\"><strong>1. MYTH: You have to be a U.S. citizen to get food stamps.</strong><br><strong>FACT:</strong> Some legal immigrants can get food stamps. If you are a legal immigrant, you may qualify.</span></p>\r\n<p><span style=\"font-size: small;\"><br><strong>2. MYTH: If you don&rsquo;t have legal status, you can&rsquo;t get food stamps.</strong><br><strong>FACT:</strong> Undocumented people can&rsquo;t get food stamps but citizens and some legal immigrants, who live with them, can get food stamps, including children.</span></p>\r\n<p><span style=\"font-size: small;\"><br><strong>3. MYTH: Children of undocumented immigrants can&rsquo;t get food stamps.</strong><br><strong>FACT:</strong> Children of undocumented immigrants may get food stamps if they are citizens or legal permanent<br>residents.</span></p>\r\n<p><span style=\"font-size: small;\"><br><strong>4. MYTH: Undocumented people who apply for Food Stamps, or live with people who get Food</strong><br><strong>Stamps are reported to United States Citizenship &amp; Immigration Services (USCIS).</strong><br><strong>FACT:</strong> Food Stamp information is confidential but the food stamp office checks immigration documents received with USCIS. If you are not documented, you won&rsquo;t be asked for immigration documents. Other members of the household can still apply and may be eligible.</span></p>\r\n<p><span style=\"font-size: small;\"><br><strong>5. MYTH: You can&rsquo;t get food stamps even if you have a green card and work.</strong><br><strong>FACT:</strong> Many legal immigrants are eligible. Generally, if you have been in the U.S. legally for 5 years or are a child under 18, get a disability-related benefit, or have enough work history in the U.S, you may be able to get food</span></p>',0,59,'foodstamp.jpg','foostamp','right',1),(150,'Test Your Knowledge',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Test your Knowledge</strong></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',0,60,'test_your_knowledge.jpg','test_your_knowledge','center_top',1),(151,'Sample Menu for a 2000 Calorie Food Patern',0,'txt','',0,61,'sample_menu_1r.jpg','Sample Menu','center_top',1),(152,'My Pyramid Worksheet',0,'txt','<p>My Pyramid Worksheet</p>',0,62,'pyramid_worksheet.jpg','pryamid','center_bottom',1),(154,'Rent Assistance Options',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong><em>Rent Assistance Options</em></strong></span></p>\r\n<p align=\"center\"><em>Subsidized housing is a form of housing which is made accessible through government assistance to people who have difficulty finding and affording housing. Many governments have subsidy programs in place for housing, viewing safe, clean pleasant places to live as important for their citizens.</em></p>\r\n<p style=\"text-align: center;\"><br><span style=\"text-decoration: underline; font-size: small;\"><strong>What options are there for me?</strong></span></p>\r\n<p><strong><span style=\"text-decoration: underline;\">Housing Choice Voucher:</span></strong>The housing choice voucher program is the federal government&rsquo;s major program for assisting very low income families, the elderly and people with disabilities &nbsp;to afford decent, safe and sanitary housing in the private market that is administered locally by Public Housing Agencies (PHA&rsquo;s)</p>\r\n<p><strong><em>How it works&hellip;</em></strong></p>\r\n<ul>\r\n<li>Eligibility is determined by the PHA&rsquo;s; during the application process the PHA will collect information such as the family income, assets, and family composition.</li>\r\n<li>A family is issued a housing voucher and is responsible for finding a suitable housing unit; the unit may include present residence.</li>\r\n<li>The participant is free to choose any housing that meets the requirements of the program and is not limited to units located in subsidized housing projects, so long as the owner agrees to rent through the program.</li>\r\n<li>The housing subsidy is paid to the landlord directly by PHA on behalf of the participating family; the family is now responsible to pay the difference (if any) between the actual rent charge and the amount subsidized.</li>\r\n</ul>\r\n<p><strong><span style=\"text-decoration: underline;\">Public Housing</span></strong>: Is another program geared towards assisting low income families, the elderly and<br>people with disabilities with decent and safe rental housing. Public housing comes in all sizes and types<br>from scattered single family houses to high-rise apartments.</p>\r\n<p><br><strong><em>How is eligibility determined &hellip;</em></strong></p>\r\n<ul>\r\n<li>Annual gross income</li>\r\n<li>Whether you qualify as elderly, a person with disabilities or as a low income family.</li>\r\n<li>U.S citizenship or eligible immigration status</li>\r\n</ul>\r\n<p align=\"center\"><em>If the PHA determines that you are eligible, your name will be put on a waiting list, unless the PHA is able to assist you immediately. The PHA will contact you once your name is reached on the waiting list. If it is determined that you are ineligible the PHA must say why and if you wish you can request an additional hearing. If you would like more information on the above programs and how to apply, contact your local Public Housing Authority or visit the HUD website </em><a href=\"http://www.hud.gov\"><strong>www.hud.gov</strong></a><strong>.</strong></p>',0,64,'','','',1),(142,'Fruits and Dairy',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Fruits</strong></span></p>\r\n<p>Any fruit or 100% fruit juice counts as part of the Fruit Group. Fruits may be fresh, canned, frozen, or dried, and may be whole, cut-up, or pureed.</p>\r\n<p><br><strong>Create your own menu:</strong></p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Top 3 Fruit Tips</strong></p>\r\n<ol>\r\n<li><strong>Keep visible reminders.</strong>\r\n<ul>\r\n<li>Keep a bowl of whole fruit on the table, counter, or in the refrigerator.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Include fruit at breakfast.</strong>\r\n<ul>\r\n<li>At breakfast, top your cereal with bananas, peaches, or strawberries; add blueberries to pancakes; drink 100% orange or grapefruit juice. Or, try a fruit mixed with fat-free or low-fat yogurt.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Think about variety.</strong>\r\n<ul>\r\n<li>Buy fruits that are dried, frozen, and canned (in water or 100% juice) as well as fresh, so that you always have a supply on hand.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',0,52,'fruits.jpg','fruits','left',1),(187,'Dairy',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Dairy</strong></span></p>\r\n<p>All fluid milk products and many foods made from milk are considered part of this food group. Most Dairy Group choices should be fat-free or low-fat. Foods made from milk that retain their calcium content are part of the group. Foods made from milk that have little to no calcium, such as cream cheese, cream, and butter, are not. Calcium-fortified soymilk (soy beverage) is also part of the Dairy Group.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Create your own menu:</strong></p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong><span style=\"font-size: x-small;\">Top 3 Dairy Tips</span> </strong></p>\r\n<p>(in water or 100% juice) as well as fresh, so that you always have a supply on hand.</p>\r\n<p><strong>1Boost potassium and vitamin D, and cut sodium</strong>. - Choose fat-free or low-fat milk or yogurt more often than cheese. Milk and yogurt have more potassium and less sodium than most cheeses. Also, almost all milk and many yogurts are fortified with vitamin D.</p>\r\n<p><strong>2 Choose sweet dairy foods with care.</strong> - Flavored milks, fruit yogurts, frozen yogurt, and puddings can contain a lot of added sugars. These added sugars are empty calories. You need the nutrients in dairy foods&mdash;not these empty calories.</p>\r\n<p><strong>3 Can&rsquo;t drink milk?</strong> - If you are lactose intolerant, try lactose-free milk, drink smaller amounts of milk at a time, or try soymilk (soy beverage). Check the Nutrition Facts label to be sure your soymilk has about 300 mg of calcium.</p>\r\n<p style=\"text-align: left;\">Calcium in some leafy greens is well absorbed, but eating several cups each day to meet calcium needs may be unrealistic.</p>',1,52,'dairy.jpg','dairy','left',1),(141,'Protein & Vegetable ',0,'txt','<p><strong>Top 3 Protein Tips</strong></p>\r\n<ol>\r\n<li><strong>Choose seafood twice a week</strong>\r\n<ul>\r\n<li>Eat seafood in place of meat or poultry twice a week. Select a variety of seafood&mdash;include some that are higher in oils and low in mercury, such as salmon, trout, and herring.</li>\r\n</ul>\r\n</li>\r\n</ol><ol>\r\n<li><strong>Make meat and poultry lean or low fat</strong>\r\n<ul>\r\n<li>Choose lean or low-fat cuts of meat like round or sirloin and ground beef that is at least 90% lean. Trim or drain fat from meat and remove poultry skin.</li>\r\n</ul>\r\n</li>\r\n</ol><ol>\r\n<li><strong>Make a healthy sandwich</strong>\r\n<ul>\r\n<li>Choose turkey, roast beef, canned tuna or salmon, or peanut butter for sandwiches. Many deli meats, such as regular bologna or salami, are high in fat and sodium&mdash;make them occasional treats only.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Protein:</strong><br>All foods made from meat, poultry, seafood, beans and peas, eggs, processed soy products, nuts, and seeds are considered part of the Protein Foods Group. Beans and peas are also part of the Vegetable Group.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Top 3 Vegetable Tips</p>\r\n<ol>\r\n<li><strong>Check the freezer aisle</strong>\r\n<ul>\r\n<li>Frozen vegetables are quick and easy to use and are just as nutritious as fresh veggies. Try adding frozen corn, peas, green beans, spinach, or sugar snap peas to some of your favorite dishes or eat as a side dish.</li>\r\n</ul>\r\n</li>\r\n<li><strong>While you&rsquo;re out</strong>\r\n<ul>\r\n<li>If dinner is away from home, no need to worry. When ordering, ask for an extra side of vegetables or side salad instead of the typical fried side dish.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Try something new</strong>\r\n<ul>\r\n<li>You never know what you may like. Choose a new vegetable&mdash;add it to your recipe or look up how to fix it.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Vegetables:</strong><br>Any vegetable or 100% vegetable juice counts as a member of the Vegetable Group. Vegetables may be raw or cooked, fresh, frozen, or dried/dehydrated.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>',1,50,'','','',0),(155,'Rent Accumulation Table',0,'txt','<p style=\"text-align: center;\">&nbsp;</p>\r\n<p align=\"center\"><span style=\"font-size: small;\"><strong><span style=\"text-decoration: underline;\">Rent Accumulation Table</span></strong></span></p>\r\n<p align=\"center\"><em>The amount your current rent can be accumulated to over a number of years</em></p>\r\n<table style=\"width: 523px; height: 141px; border-color: #ffffff; border-width: 1px; border-style: solid;\" border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td><strong>If monthly rent is</strong></td>\r\n<td>1year (monthly rent x12)</td>\r\n<td>\r\n<p align=\"center\">2 years (monthly rent</p>\r\nX 24)</td>\r\n<td>\r\n<p align=\"center\">3 years (monthly rent</p>\r\nX 36)</td>\r\n<td>\r\n<p align=\"center\">5 years (monthly rent</p>\r\nX 60)</td>\r\n<td>\r\n<p align=\"center\">7 years (monthly rent</p>\r\nX 84)</td>\r\n<td>\r\n<p align=\"center\">10 years (monthly rent</p>\r\n&nbsp;X 120)</td>\r\n<td>\r\n<p align=\"center\">20 years (monthly rent</p>\r\nX 240)</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">$700</td>\r\n<td style=\"text-align: center;\">$8400</td>\r\n<td style=\"text-align: center;\">$16800</td>\r\n<td style=\"text-align: center;\">$25200</td>\r\n<td style=\"text-align: center;\">$42000</td>\r\n<td style=\"text-align: center;\">$58800</td>\r\n<td style=\"text-align: center;\">$84000</td>\r\n<td style=\"text-align: center;\">$168000</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">$1000</td>\r\n<td style=\"text-align: center;\">$12000</td>\r\n<td style=\"text-align: center;\">$24000</td>\r\n<td style=\"text-align: center;\">$36000</td>\r\n<td style=\"text-align: center;\">$60000</td>\r\n<td style=\"text-align: center;\">$84000</td>\r\n<td style=\"text-align: center;\">$120000</td>\r\n<td style=\"text-align: center;\">$240000</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">$1400</td>\r\n<td style=\"text-align: center;\">&nbsp; $16800&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;&nbsp;&nbsp;&nbsp; $33600</td>\r\n<td style=\"text-align: center;\">$50400</td>\r\n<td style=\"text-align: center;\">$84000</td>\r\n<td style=\"text-align: center;\">$117600</td>\r\n<td style=\"text-align: center;\">$168000</td>\r\n<td style=\"text-align: center;\">$336000</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">$1600</td>\r\n<td style=\"text-align: center;\">$19200</td>\r\n<td style=\"text-align: center;\">$38400</td>\r\n<td style=\"text-align: center;\">$57600</td>\r\n<td style=\"text-align: center;\">$96000</td>\r\n<td style=\"text-align: center;\">$134400</td>\r\n<td style=\"text-align: center;\">$192000</td>\r\n<td style=\"text-align: center;\">$384000</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: left;\" align=\"center\">&nbsp;</p>\r\n<div>\r\n<table cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">\r\n<p align=\"center\"><strong><em><span style=\"text-decoration: underline;\">What option fits you??</span></em></strong></p>\r\n<p align=\"center\"><strong><em>The chart above is an effective tool to understand the amount of $$money$$ that would be spent in rent over a period of time.</em></strong></p>\r\n<p align=\"center\"><strong><em>The ultimate decision to rent or buy lies with the potential home buyer or renter and depends on many factors including <em><strong><em>down-payment, credit history and employment</em></strong></em></em></strong></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<p style=\"text-align: left;\" align=\"center\"><em><strong><em>&nbsp;</em></strong></em></p>\r\n<p align=\"center\"><strong><em>You can now calculate your own rent accumulation in the space provided below.</em></strong></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\">Rent</td>\r\n<td style=\"text-align: center;\">Monthly rent x 12</td>\r\n<td style=\"text-align: center;\">Montly rent x 24</td>\r\n<td style=\"text-align: center;\">Monthly rent x 36</td>\r\n<td style=\"text-align: center;\">Monthly rent x 60</td>\r\n<td style=\"text-align: center;\">Monthly rent x 84</td>\r\n<td style=\"text-align: center;\">&nbsp;Monthly rent x 120</td>\r\n<td style=\"text-align: center;\">Monthly rent x 240</td>\r\n</tr>\r\n<tr>\r\n<td>$</td>\r\n<td>$</td>\r\n<td>$</td>\r\n<td>$</td>\r\n<td>$</td>\r\n<td>$</td>\r\n<td>$</td>\r\n<td>$</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong><em><span style=\"text-decoration: underline;\">Food for Thought:</span></em></strong><strong><em>&nbsp; How much could you save for a down payment for your own home if you paid less rent?</em></strong></p>\r\n<p style=\"text-align: center;\">&nbsp;</p>',0,65,'','','',1),(156,'Buying a Home',0,'txt','<p align=\"center\"><span style=\"font-size: small;\"><strong><span style=\"text-decoration: underline;\">Buying a Home</span></strong></span></p>\r\n<p>Most mortgage lenders require home buyers spend less than 30% of their Annual Adjusted<br>Income on home mortgage payments (Family Contribution). Use this sheet to determine what<br>your Family Contribution should be to meet the lenders&rsquo; guidelines.</p>\r\n<p align=\"center\"><strong>Computing Annual Income (</strong><strong>How the 30% is determined)</strong></p>\r\n<p align=\"center\">Annual Income is determined by calculating:</p>\r\n<p style=\"text-align: center;\">Anticipated total (or gross income) minus allowable exclusions.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Part One:&nbsp; Calculating Annual Income</strong></p>\r\n<ol start=\"1\">\r\n<li>Multiply hourly wages by the number of hours worked/year (2080 hrs.&rsquo; for full-time employment with a 40- hour work week and no overtime)</li>\r\n<li>Multiply weekly wages by 52</li>\r\n<li>Multiply bi-weekly wages by 26</li>\r\n<li>Multiply semi-monthly wages by 24</li>\r\n<li>Multiply monthly wages by 12</li>\r\n</ol>\r\n<p style=\"text-align: center;\"><strong>Compute Total Income</strong></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>Instructions</strong></td>\r\n<td style=\"text-align: center;\"><strong>Example (Hourly Wages)</strong></td>\r\n<td style=\"text-align: center;\"><strong>Your Income</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Wages (Hourly)</td>\r\n<td style=\"text-align: center;\">11.00 hrs. x 40 hrs./week = $440</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Multiply weekly wages by 52 weeks (to get wages for 1 year)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">$440 x 52 = 22, 880</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Multiply monthly benefits by 12 months</td>\r\n<td style=\"text-align: center;\">\r\n<p style=\"text-align: center;\">Social Security:</p>\r\n$600 x 12 = $7,200</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Add all income&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">Total Annual Income = $30,080</td>\r\n<td style=\"text-align: center;\">(A)$</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Part Two: Income after Allowances</strong></p>\r\n<p style=\"text-align: center;\"><strong><strong>You Can Deduct Certain Expenses</strong></strong></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\">Instruction</td>\r\n<td style=\"text-align: center;\">Example (Hourly wage)</td>\r\n<td style=\"text-align: center;\">Your deductions</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\"><span style=\"text-decoration: underline;\">$480.00 Deduction</span> for each minor under 18 yrs. of age</td>\r\n<td style=\"text-align: center;\">2 minors x $480 each = $960</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Child care expenses</td>\r\n<td style=\"text-align: center;\">&nbsp;$ 0</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Other expenses</td>\r\n<td style=\"text-align: center;\">&nbsp;$ 0</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Part one (A) minus part two (B) = &nbsp;Adjusted Annual income (C)</td>\r\n<td style=\"text-align: center;\">$ 29, 120</td>\r\n<td style=\"text-align: center;\">(C)$</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>Part Three: Family Contribution</strong></p>\r\n<p style=\"text-align: center;\"><strong><strong>What is 30% of your Adjusted Annual&nbsp; Income</strong></strong></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Instructions</td>\r\n<td>Example (Hourly wage)</td>\r\n<td>Your Family Contribution</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">\r\n<p>Adjusted Annual Income (C)</p>\r\n<p>divided by 12 x 0.30</p>\r\n= 30% adjusted monthly income</td>\r\n<td>\r\n<p style=\"text-align: center;\">$ 29, 120 &divide;12 = $2,427</p>\r\n<p style=\"text-align: center;\">$2,427 x 0.30</p>\r\n= $728 (Family Contribution)</td>\r\n<td>$</td>\r\n</tr>\r\n</tbody>\r\n</table>',0,66,'','','',1),(157,'Financial Assistance for Household Expenses',0,'txt','<p align=\"center\"><strong><span style=\"text-decoration: underline;\">Financial Assistance for Household Expenses</span></strong></p>\r\n<p style=\"text-align: left;\">There are several programs that help low income persons to meet economic emergencies. They are<br>designed to address personal or family budget needs that cannot be met due to sudden loss of income<br>or unexpected expenses. The assistance is short-term and may not be subject to a limited number of<br>incidents. There are many types of emergency financial assistance.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Emergency Food and Shelter Program (EFSP)</span></strong></p>\r\n<p>Emergency Food and Shelter Program (EFSP) EFSP is a federally funded program administered through local community agencies. In Broward County several agencies provide a<br>range of services under this program:</p>\r\n<ul>\r\n<li>Food baskets or food vouchers/gift cards</li>\r\n<li>Meals at mass feeding sites</li>\r\n<li>Lodging at mass shelter sites</li>\r\n<li>Emergency lodging at hotels/motels</li>\r\n<li>Rent/mortgage payment assistance (1 month) to prevent eviction</li>\r\n<li>First month&rsquo;s rent to prevent homelessness</li>\r\n<li>Utility bill assistance for one month&rsquo;s usage</li>\r\n</ul>\r\n<p><em>Eligibility for these services may vary between agencies, but generally involve a case-by-case evaluation of a family&rsquo;s income/expense budget. Neither proof of citizenship nor qualified alien status is required.&nbsp; Rent/mortgage/utility assistance may not be received under this program more often than once in 12 months.</em></p>',0,67,'efsp.jpg','efsp','right',1),(180,'Broward County Emergency Assistance',0,'txt','<p align=\"center\"><strong><span style=\"text-decoration: underline;\">Broward County Emergency Assistance</span></strong></p>\r\n<p style=\"text-align: left;\" align=\"center\">&nbsp;</p>\r\n<p>Assistance may be obtained for rental payments, mortgage payments, and city utility bills of families who face one time economic emergencies (sudden loss of income or unexpected expenses).Eligibility is based on a review of a family&rsquo;s income/expenses and the circumstances that lead to the crisis.&nbsp; Payments are generally limited to 80% of the rental/mortgage payment or past due utility bill. This type of assistance may be used only once in a 24 month period and only three times during one&rsquo;s lifetime.</p>\r\n<p style=\"text-align: left;\" align=\"center\">&nbsp;</p>',1,67,'broward_logo.jpg','broward_logo','right',1),(158,'Beware of Foreclosure Rescue Scams!',0,'txt','<p align=\"center\"><strong><span style=\"text-decoration: underline;\">Beware of Foreclosure Rescue Scams!</span></strong></p>\r\n<p><strong><em>Real Help is Free!</em></strong></p>\r\n<p><br>Foreclosure rescue and mortgage modification scams are growing problem that cost you thousands of dollars or even your home.</p>\r\n<p>Scammers make promises that they can&rsquo;t keep such as guaranteeing to &ldquo; save &ldquo; your home or lower your mortgage , usually for a fee , often pretending that they have direct contact with your mortgage servicer- which they do not.</p>\r\n<p>&nbsp;</p>',0,68,'loan_modification_scam.jpg','Loan_Scam','right',1),(182,'AVOID anyone who',0,'txt','<p><strong><em>AVOID anyone who:</em></strong></p>\r\n<ol>\r\n<li>Asks for FEE IN ADVANCE</li>\r\n<li>Guarantees that they will stop foreclosure or modify a loan</li>\r\n<li>Tells you to STOP PAYING your mortgage company and pay them instead</li>\r\n<li>Pressures you to sign papers immediately</li>\r\n</ol>\r\n<p><strong><em>What to Do If You Have Been the Victim of a Scam</em></strong></p>\r\n<p>If you believe you have been the victim of a scam, you should file a complaint with the Federal Trade Commission (FTC).</p>\r\n<p><strong>Resources to Help You Avoid Scams:</strong></p>\r\n<ul>\r\n<li>Federal Trade Commission- Watch the Foreclosure Resources Scams Video on the FTC&rsquo;s YouTube Channel.</li>\r\n<li>Office of the Comptroller of the Currency &ndash; The U.S Department of the Treasury&rsquo; Office of the Comptroller of the Currency provides tips and materials to help homeowners avoid mortgage modification and foreclosure rescue scams.</li>\r\n<li>Loan Modification Scam Prevention Network &ndash; The loan modification Prevention network is a national coalition of governmental and private organizations created to provide resources to educate home owners about the danger of loan modification scams and support federal, state and local efforts to combat these scams. If you believe you have been the victim of a scam, you can report the scam the campaign&rsquo;s online complaint form.</li>\r\n</ul>\r\n<p>&nbsp;</p>',1,68,'scams.jpg','scams','right',1),(160,'Home Ownership Assistance',0,'txt','<p align=\"center\"><span style=\"font-size: small;\"><strong>Home Ownership Assistance</strong></span></p>\r\n<p>The federal government allocates funds to large local cities to conduct housing and community related activities, repair streets, further fair housing etc. Among these eligible activities is providing financial assistance to homebuyers and homeowners for home purchase or rehabilitation. Navigating through the grant process can be difficult, particularly if you want to use it to purchase your first home. But this shouldn&rsquo;t discourage you from looking into what is available out there to help you become a home owner. <strong>Here are some tips and questions that can be incredibly helpful to navigate through the process.</strong></p>\r\n<ul>\r\n<li>Pull the list of Community Development Block Grant Entitlement Cities from the <a href=\"http://www.hud.gov\">www.hud.gov</a> website</li>\r\n<li>\r\n<p>If you are interested, call the city that you are interested in and ask some of the following questions&hellip;</p>\r\n<p>a)&nbsp;&nbsp; Do you offer funds to buyers for homeownerships?</p>\r\n<p>b)&nbsp;&nbsp; What type of funding is available?</p>\r\n<p>c)&nbsp;&nbsp; What are the eligibility requirements?</p>\r\n<p>d)&nbsp;&nbsp; What is your process to access funds?</p>\r\n<p>e)&nbsp;&nbsp; What is your process to access the funds?</p>\r\n<p>f)&nbsp;&nbsp;&nbsp;&nbsp; Do I have to pay these funds back and if so, under what circumstances?</p>\r\n<p>g)&nbsp;&nbsp; How will this affect the purchase of my home?</p>\r\n</li>\r\n<li>\r\n<p>After this the burden will fall on you. Each city has different requirements and criteria. Don&rsquo;t let the great deal of paperwork and eligibility verification required frustrate you!</p>\r\n</li>\r\n<li>\r\n<p>The process is the same if you are a homeowner seeking rehabilitation assistance for your current home. &nbsp;</p>\r\n</li>\r\n</ul>\r\n<p>&nbsp;</p>',0,70,'Home_Ownership_Assistance.jpg','HOA','right',1),(161,'Financial Plan:',0,'txt','<p><strong>Have you ever wanted to buy something big,</strong><br><strong>like your own computer or a car? Or dreamed</strong><br><strong>about becoming a multi-millionaire and retiring</strong><br><strong>at 40?</strong></p>\r\n<p><br>It is possible for you to do all of these things if you get<br>savvy about managing your money.</p>\r\n<p><br>In this section, you will begin your journey toward<br>savvy money management by learning about the financial planning process. People who &ldquo;have it all&rdquo;<br>didn&rsquo;t get there by accident. They made a financial plan and allowed it. You will use what you learn<br>in this section to create your own personal financial plan.</p>\r\n<p><br>Although we might not realize it, we are always managing money to get something we want, but in<br>order to achieve this goal we have to follow some sort of roadmap or a blueprint for our journey. A<br>monthly Budget Guide is one of the most important tools to good money management, because it&rsquo;s<br>a simple aid, created to give us an overview of our current economic situation and a glimpse of our<br>foreseeable future.</p>\r\n<p style=\"text-align: center;\"><br><strong>The Basics of Financial Planning</strong></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p>&loz;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Make money work for you so you can lead the kind of life you want.&nbsp;</p>\r\n<p>&loz;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Don&rsquo;t let money control you.</p>\r\n<p>&loz;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Always remember that it is just a means to an end, not the end itself</p>\r\n<p><strong>Step 1</strong>: Set Financial Goals<br><strong>Step 2</strong>: Analyze Your Spending: Where Does Your Money Go?<br><strong>Step 3</strong>: Create a Budget: Build Your Financial Roadmap<br><strong>Step 4</strong>: Stay on Track: Monitor and Modify the Plan to Fit<br><strong>Step 5</strong>:Your Goals<br><strong>Step 6</strong>:Work with Your Budget: Be a Responsible Spender</p>\r\n<p>&nbsp;</p>',0,71,'financial_plan1.jpg','financial_plan','right',1),(162,'Needs vs. Wants',0,'txt','<p align=\"center\"><strong>Needs vs. Wants</strong></p>\r\n<ol>\r\n<li style=\"text-align: left;\"><strong>List some of your Needs</strong> in the space below. Try to think of needs that are immediate, as well as things you&rsquo;ll need in the next several months. Next, <strong>write down some of your Wants</strong>. Are you starting to see the difference?</li>\r\n</ol>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Needs &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n<td style=\"text-align: center;\">Wants&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>2. Write your estimates</strong> of what you think each item in your needs and wants lists will cost and whether&nbsp;&nbsp;&nbsp; they are long term (longer than 1 year away) or short term (less than one year)</p>\r\n<p><strong>3</strong>. <strong>Now</strong> <strong>highlight your most important Needs and Wants. </strong>&nbsp;Are there wants that you could do without?</p>',0,72,'','','',1),(163,'Step 1: Setting Goals',0,'txt','<p><span style=\"font-size: small;\"><strong>Step 1:</strong> <strong>Setting Goals</strong></span></p>\r\n<p><em>All the elements in the financial planning process work together</em>:</p>\r\n<p>Set financial goals, which may be short term, or long term</p>\r\n<p>&loz;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Your values influence your needs and goals.</p>\r\n<p>&loz;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; The decisions you make affect your goals.</p>\r\n<p>Spending money on your wants may limit meeting your needs</p>\r\n<p style=\"text-align: center;\"><strong>Short Term Goals (1 to 5 years)</strong></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Description&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">Amount&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">Completion Date&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: center;\"><strong>Long Term Goals (over 5 years)</strong></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Description&nbsp; &nbsp;&nbsp;&nbsp;</td>\r\n<td>Amount&nbsp;&nbsp; &nbsp; &nbsp;</td>\r\n<td>Completion Date &nbsp;&nbsp; &nbsp;&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>',1,73,'','','',1),(164,'Step 2: Analyze Your Spending',0,'txt','<p><strong>Step 2:</strong>&nbsp; <strong>Analyze Your Spending</strong></p>\r\n<p>A great way of attaining your financial goals includes understanding your financial planning. To help prevent credit issues, create a spending plan. This spending plan allows you to keep track, and not get lost in debt in just four steps:</p>\r\n<p><strong>1.&nbsp;&nbsp;&nbsp; </strong><strong>Identifying Income</strong></p>\r\n<p><strong>2.&nbsp;&nbsp;&nbsp; </strong><strong>Listing Expenses</strong></p>\r\n<p><strong>3.&nbsp;&nbsp;&nbsp; </strong><strong>Comparing Income and Expenses</strong></p>\r\n<p><strong>4.&nbsp;&nbsp;&nbsp; </strong><strong>Set Priorities and Make Changes</strong></p>\r\n<p align=\"center\"><strong>Where Does Your Money Go?</strong></p>\r\n<p align=\"center\"><strong>Personal Spending Log</strong></p>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Income&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">Expense&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p align=\"center\"><strong>Day 1</strong></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Description&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td style=\"text-align: center;\">Amount &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n<td>Description&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td>Amount&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p align=\"center\"><strong>Day 2</strong></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Description&nbsp; &nbsp;&nbsp; &nbsp;</td>\r\n<td>Amount &nbsp; &nbsp; &nbsp;&nbsp;</td>\r\n<td>Description&nbsp; &nbsp; &nbsp;&nbsp;&nbsp;</td>\r\n<td>Amount &nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>',0,74,'','','',1),(165,'Income & Expenses',0,'txt','<p>Income &amp; Expenses</p>',0,75,'','','',1),(166,'Guidelines for Sticking with Your Plan',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: medium;\"><strong>Guidelines for Sticking with Your Plan</strong></span></p>\r\n<ul>\r\n<li style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"> Write your goals on an index card or find pictures of your goals and post them in a place<br>where you can see them every day.</span></span></li>\r\n<li style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"><span style=\"font-size: x-small;\">Tell other people about your goals. Also ask someone to check in with you about your<br>progress &ndash; knowing someone is going to ask about it is good motivation!</span></span></li>\r\n<li style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"><span style=\"font-size: x-small;\">When you&rsquo;re going to spend money, decide how much you&rsquo;ll need ahead of time and<br>take only that amount so that you&rsquo;re not tempted to spend more.</span></span></li>\r\n<li style=\"font-size: x-small;\"><span style=\"font-size: x-small;\"><span style=\"font-size: x-small;\">Review your plan regularly so you know when you&rsquo;re starting to stray and can make<br>adjustments quickly.</span></span></li>\r\n</ul>\r\n<p><span style=\"font-size: medium;\"><strong>Are You Saving?</strong></span></p>\r\n<p><span style=\"text-decoration: underline;\"><span style=\"font-size: small;\"><strong>Why Is Saving Money Important?</strong></span></span></p>\r\n<p><span style=\"font-size: x-small;\">Every day we are faced with an expense, a bill or an item we need to purchase. This makes saving extra money very difficult. At the same time, without saving we are not planning ahead for those emergencies that happen to everyone. No one wants to plan for losing their job, becoming disabled, the car breaking down, or some other financial crisis. Saving is critical to successfully facing these crises. With savings, we have an increased possibility of having the money available to resolve the problems we did not expect. </span></p>\r\n<p>&nbsp;</p>',0,76,'','','',1),(167,'Why is Retirement Planning Important?',0,'txt','<p><span style=\"text-decoration: underline; font-size: medium;\"><strong>Why is Retirement Planning Important?</strong></span></p>\r\n<p><span style=\"font-size: x-small;\">It is never too early to plan for retirement. Planning for retirement will help you build a sense of security<br>after you make the transition from employment to retirement. Importantly, by planning for retirement<br>you will more likely stay independent instead of placing a big pressure on your family and loved<br>ones to take care of you at an old age.</span></p>\r\n<p><span style=\"font-size: x-small;\">&nbsp;</span></p>',0,77,'retirement_planning.jpg','retirement','right',1),(168,'How Do I Save for Retirement with a Small Salary?',0,'txt','<p><span style=\"text-decoration: underline; font-size: medium;\"><strong>How Do I Save for Retirement with a Small Salary?</strong></span></p>\r\n<ol>\r\n<li><span style=\"font-size: x-small;\"><strong>Set up a direct deposit.</strong> Have a portion of each paycheck automatically deposited into a401(k), IRA, savings, or investment account. Start with as little as 1 percent of your pay and as you<br>receive raises, direct a portion of each one into a retirement or investment account.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Take advantage of tax breaks</strong>. Saving in a retirement account has the added bonus ofreducing your current or future taxes. Traditional 401(k)s and IRAs give you a tax break in the year<br>you make the contribution.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Claim the saver\'s credit</strong>. There is a tax credit specifically for low-income workers who savefor retirement. If you contribute to a retirement account such as an IRA or 401(k) , you may be able<br>to claim the saver\'s credit.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Redirect your tax refund and tax break</strong>. If you don\'t need your tax refund for immediateexpenses or debts, consider saving a portion of it for retirement.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Learn about Social Security</strong>. Social Security payments are the biggest source of retirementincome for low-wage workers. The age when you decide to start your benefit can make a big<br>difference in how much your monthly payments will be for the rest of your life. Think carefully about<br>whether you want to start that Social Security benefit right away when you hit 62, or whether it\'s<br>really more valuable to you to wait until age 70 if you can do so. Monthly payouts increase for each<br>year you delay claiming up until age 70.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Seek a job with good retirement benefits</strong>. Finding a job that offers a traditional pension, asignificant 401(k) match, or a profit-sharing plan can significantly improve your retirement security.<br></span></li>\r\n<li><span style=\"font-size: x-small;\"><strong>Don\'t spend your savings early</strong>. Once you begin to build a nest egg, try not to spend any ofit before retirement. Early withdrawals also mean that you won\'t have that money and the valuable<br>compound interest it could have generated in retirement</span></li>\r\n</ol>',1,77,'','','',1),(169,'The Cost of Financial Services',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: medium;\"><strong>The Cost of Financial Services</strong></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Finding financial services that meet your needs is not an easy task. It is especially difficult if you are</span><br><span style=\"font-size: x-small;\">experiencing financial hardship.</span></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Please know that all financial institutions are not alike. There are traditional<br>banks and credit unions, but there are also non-traditional lending institutions<br>such as payday loan stores, check cashing stores, pawn shops and corner<br>stores that offer similar services, but for a different price.</span></span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><br>While the decision of selecting which type of financial institution may be hard,<br>there are many things to consider related to the</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><span style=\"text-decoration: underline;\">FEES for services</span>,</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><span style=\"text-decoration: underline;\">PENALTIES for services</span> and</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><span style=\"text-decoration: underline;\">the EXPEDIENCE of the service</span>.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Sometimes what may be convenient is actually more expensive.</span></span></p>\r\n<p>&nbsp;</p>',0,78,'atm_fee1.jpg','atm','left',1),(170,'10 steps to shopping for a financial institution',0,'txt','<p>There are a number of ways to save your money, invest your money and to keep your<br>money safe.</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\"><span style=\"font-size: small;\"><strong>10 steps to shopping for a financial institution</strong></span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><span style=\"font-size: x-small;\">1. Educate yourself and do the proper research to find the options that will benefit you</span><br><span style=\"font-size: x-small;\">personally and financially. You!</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">2. Figure out what you want out of the bank you choose,</span><br><span style=\"font-size: x-small;\">simple savings or multiple services.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">3. Check out the different interest rates paid while your money</span><br><span style=\"font-size: x-small;\">is in the bank.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">4. Decide if you want a bank close to home or work, or if using</span><br><span style=\"font-size: x-small;\">ATM, multiple locations.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">5. Investigate the fees the bank charges for checking, overdraft</span><br><span style=\"font-size: x-small;\">penalty, or if a minimum balance is required.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">6. Visit the banks you are interested in doing business with. Is</span><br><span style=\"font-size: x-small;\">the staff professional and courteous? Do you feel</span><br><span style=\"font-size: x-small;\">comfortable banking there?</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">7. Ask your friends and family where they bank and if they are satisfied or recommend their</span><br><span style=\"font-size: x-small;\">bank.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">8. Remember, this is a big decision and it&rsquo;s your decision to make. You don&rsquo;t have to give</span><br><span style=\"font-size: x-small;\">your money to a financial institution that has poor customer service or limited hours of</span><br><span style=\"font-size: x-small;\">operation.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">9. If using ATM cards, check out the locations and make sure they are convenient. If you</span><br><span style=\"font-size: x-small;\">use an ATM that does not belong to your bank you will most likely pay a fee. Tip &ndash; If you</span><br><span style=\"font-size: x-small;\">need cash and are out shopping and don&rsquo;t have access to an ATM that is associated</span><br><span style=\"font-size: x-small;\">with your bank, ask for cash back when you make your purchases with your debit card.</span><br><span style=\"font-size: x-small;\">There is no charge.</span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><br><span style=\"font-size: x-small;\">10.You may want to research credit unions, a cooperative financial institution, owned and</span><br><span style=\"font-size: x-small;\">controlled by the people who use its services. The difference between a bank and a</span><br><span style=\"font-size: x-small;\">credit union is that credit unions are non- profit institutions and are not in business to</span><br><span style=\"font-size: x-small;\">make a profit like regular banks. You should make certain that the credit union you are</span><br><span style=\"font-size: x-small;\">researching is convenient for your banking</span></span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>',0,79,'10_steps.jpg','10_steps','right',1),(171,'Monthly Budget Guide',0,'txt','<p>Monthly Budget Guide</p>',0,80,'','','',1),(172,'Staying on Track',0,'txt','<p><span style=\"font-size: medium;\"><strong>Step 5: Staying on Track</strong></span></p>\r\n<p><span style=\"font-size: x-small;\">Once you start working with your budget, you should check to make sure that you&rsquo;re staying on track. Review your plan and your progress at periods &ndash; every two weeks or every month. The more often you review your budget, the sooner you&rsquo;ll catch yourself if you start straying off course.</span></p>\r\n<p><strong><span style=\"font-size: x-small;\">1. How Am I Doing?</span></strong></p>\r\n<p><span style=\"font-size: x-small;\"><strong>2. Review your budget whenever you have significant changes in your life.</strong><br>&loz; Marriage/divorce<br>&loz; Goals change<br>&loz; Income change<br>&loz; Unexpected expenses<br>&loz; Unexpected income</span></p>\r\n<p><span style=\"font-size: x-small;\"><strong>3. Update your budget with amounts that fit your new situation.</strong></span></p>\r\n<p><strong><span style=\"font-size: x-small;\"><br>4. Keep track of how the current budget works for you.</span></strong></p>\r\n<p><strong><span style=\"font-size: x-small;\"><br>5. Remember: your budget and financial plan have to be responsive to your current<br>situation but keep in mind your long term goals.</span></strong></p>',0,81,'','','',1),(173,'Protein & Vegetables',0,'txt','<p><strong>Top 3 Protein Tips</strong></p>\r\n<ol>\r\n<li><strong>Choose seafood twice a week</strong>\r\n<ul>\r\n<li>Eat seafood in place of meat or poultry twice a week. Select a variety of seafood&mdash;include some that are higher in oils and low in mercury, such as salmon, trout, and herring.</li>\r\n</ul>\r\n</li>\r\n</ol><ol>\r\n<li><strong>Make meat and poultry lean or low fat</strong>\r\n<ul>\r\n<li>Choose lean or low-fat cuts of meat like round or sirloin and ground beef that is at least 90% lean. Trim or drain fat from meat and remove poultry skin.</li>\r\n</ul>\r\n</li>\r\n</ol><ol>\r\n<li><strong>Make a healthy sandwich</strong>\r\n<ul>\r\n<li>Choose turkey, roast beef, canned tuna or salmon, or peanut butter for sandwiches. Many deli meats, such as regular bologna or salami, are high in fat and sodium&mdash;make them occasional treats only.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Protein:</strong><br>All foods made from meat, poultry, seafood, beans and peas, eggs, processed soy products, nuts, and seeds are considered part of the Protein Foods Group. Beans and peas are also part of the Vegetable Group.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Top 3 Vegetable Tips</p>\r\n<ol>\r\n<li><strong>Check the freezer aisle</strong>\r\n<ul>\r\n<li>Frozen vegetables are quick and easy to use and are just as nutritious as fresh veggies. Try adding frozen corn, peas, green beans, spinach, or sugar snap peas to some of your favorite dishes or eat as a side dish.</li>\r\n</ul>\r\n</li>\r\n<li><strong>While you&rsquo;re out</strong>\r\n<ul>\r\n<li>If dinner is away from home, no need to worry. When ordering, ask for an extra side of vegetables or side salad instead of the typical fried side dish.</li>\r\n</ul>\r\n</li>\r\n<li><strong>Try something new</strong>\r\n<ul>\r\n<li>You never know what you may like. Choose a new vegetable&mdash;add it to your recipe or look up how to fix it.</li>\r\n</ul>\r\n</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Vegetables:</strong><br>Any vegetable or 100% vegetable juice counts as a member of the Vegetable Group. Vegetables may be raw or cooked, fresh, frozen, or dried/dehydrated.</p>\r\n<p>&nbsp;</p>\r\n<p>Create your own menu:</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>',1,0,'','','',1),(174,'Protein & Vegetables',0,'txt','<p style=\"text-align: center;\"><strong><span style=\"font-size: small;\">Protein Foods&nbsp;</span> </strong></p>\r\n<p>All foods made from meat, poultry, seafood, beans and peas, eggs, processed soy products, nuts, and seeds are considered part of the Protein Foods Group. Beans and peas are also part of the Vegetable Group.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Create your own menu:</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>&nbsp;<span style=\"font-size: x-small;\">Top 3 Protein Tips</span></strong></span></p>\r\n<p><strong>1 </strong>Choose seafood twice a week</p>\r\n<p>Eat seafood in place of meat or poultry twice a week. Select a variety of seafood&mdash;include some that are higher in oils and low in mercury, such as salmon, trout, and herring.</p>\r\n<p><strong>2 </strong>Make meat and poultry lean or low fat</p>\r\n<p>Choose lean or low-fat cuts of meat like round or sirloin and ground beef that is at least 90% lean. Trim or drain fat from meat and remove poultry skin.</p>\r\n<p><strong>3 </strong>Make a healthy sandwich</p>\r\n<p>Choose turkey, roast beef, canned tuna or salmon, or peanut butter for sandwiches. Many deli meats, such as regular bologna or salami, are high in fat and sodium&mdash;make them occasional treats only.</p>\r\n<p>&nbsp;</p>',0,82,'prtein_food.jpg','protein_food','left',1),(186,'Vegetable',0,'txt','<p style=\"text-align: center;\"><strong><span style=\"font-size: small;\">Vegetables</span> </strong></p>\r\n<p>Any vegetable or 100% vegetable juice counts as a member of the Vegetable Group.&nbsp; Vegetables may be raw or cooked, fresh, frozen, or dried/dehydrated.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Create your own menu:</strong></p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>___________________________________________________________________</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: x-small;\"><strong>Top 3 Vegetable Tips</strong></span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p><strong>1 Check the freezer aisle</strong> - Frozen vegetables are quick and easy to use and are just as nutritious as fresh veggies. Try adding frozen corn, peas, green beans, spinach, or sugar snap peas to some of your favorite dishes or eat as a side dish.</p>\r\n<p><strong>2 While you&rsquo;re out</strong> - If dinner is away from home, no need to worry. When ordering, ask for an extra side of vegetables or side salad instead of the typical fried side dish.</p>\r\n<p><strong>3 Try something new</strong> - You never know what you may like. Choose a new vegetable&mdash;add it to your recipe or look up how to fix it.</p>\r\n<p>&nbsp;</p>',1,82,'vegetable.jpg','vegetable','right',1),(175,'What is Assisted Living?',0,'txt','<div class=\"WordSection1\">\r\n<p align=\"center\"><strong><span style=\"text-decoration: underline;\">What is Assisted Living?</span></strong></p>\r\n<p align=\"center\"><em>The general purpose of an assisted living community is to provide a supportive environment with choices and assistance to help seniors maintain independence and continue to enjoy quality of life. </em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Assisted Living- </strong><em>Residents are supported in order to maintain a maximum level of independence.</em></p>\r\n<p><em>VS.</em></p>\r\n<p><strong>Independent Living- </strong><em>Residents are able to coordinate their own care and meet their own day to day needs. </em></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong><span style=\"text-decoration: underline;\">Triggers to begin exploring assisted living</span></strong></p>\r\n<ul>\r\n<li><em>Need help bathing, dressing, and grooming</em></li>\r\n<li><em>Forgetting to take meds</em></li>\r\n<li><em>Requires more than 4 hours private duty assistance</em></li>\r\n<li><em>Weight loss or nutrition deficiency</em></li>\r\n<li><em>Physical declines, falling</em></li>\r\n<li><em>Mental changes</em></li>\r\n<li><em>Isolation, no longer socializing</em></li>\r\n</ul>\r\n</div>',0,83,'assisted_living.jpg','assited_living ','right',1),(199,'How Can I save Money',0,'txt','<p><span style=\"text-decoration: underline; font-size: small;\"><strong>How Can I Save Money?</strong></span></p>\r\n<p><span style=\"font-size: x-small;\">1. Skip going out to eat.<br>2. Turn off the lights when you are not in the room.<br>3. Have a piggy bank for the whole family to make<br>contributions.<br>4. Have an automatic deposit from your paycheck into<br>your savings account.<br>5. Find coupons and sales.<br>6. Stop using the vending machine.<br>7. Find cheap gas.<br>8. Choose the cheapest mode of transportation possible.<br>9. Teach your kids how to save.</span></p>\r\n<p><span style=\"text-decoration: underline; font-size: small;\"><strong>Build Emergency Funds</strong></span></p>\r\n<p><span style=\"font-size: x-small;\">Set aside savings for emergency purposes. An ideal savings is about 9 months of your monthly cost of living. This part of your financial plan is a good way of avoiding taking out loans.</span></p>',1,76,'how_can_save.jpg','how_can_save','right',1),(200,'CAUTION! Think about what convenience is worth to you',0,'txt','<p style=\"text-align: center;\"><strong><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><em>CAUTION!</em> Think about what convenience is worth to you</span></span></strong></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">For example, it&rsquo;s Friday, and you just received your pay. Your check was drawn by a local bank that<br>does not charge a fee for check cashing services. The bank is relatively close, but the corner store<br>is right across the street. They charge $5.</span></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Would you go to the corner store? Is your convenience worth $5?</span></span></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Sometimes it is not a matter of choice. Perhaps, you have made some poor decisions in the past that left you with limited choices.</span></span></p>\r\n<p><em><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\"><strong>Guess what? You have a second chance!</strong> </span></span></em></p>\r\n<p><span style=\"font-size: medium;\"><span style=\"font-size: x-small;\">Many lending institutions have second chance programs forbanking as long as you demonstrate a commitment to paying back what you owe. The first step is your willingness to correct the old mistake.</span></span></p>',1,78,'','','',1),(183,'Services and features found in an assisted living community',0,'txt','<p align=\"center\"><strong>Services and features found in an assisted living community</strong></p>\r\n<div class=\"WordSection2\">\r\n<ul>\r\n<li><em>Private or shared accommodations- studios, 1 bedroom, 2 bedroom apartments</em></li>\r\n<li><em>3 meals per day </em></li>\r\n<li><em>Snacks and beverages</em></li>\r\n<li><em>Utilities </em></li>\r\n<li><em>Weekly housekeeping and laundry service</em></li>\r\n<li><em>Daily bed making</em></li>\r\n<li><em>Maintenance services</em></li>\r\n<li><em>Scheduled transportation service</em></li>\r\n<li><em>Escorted group outings</em></li>\r\n<li><em>Certified Nurse Assistant &nbsp;to assist with activities of daily living (ADL&rsquo;s) &ndash; showers, dressing, grooming, incontinence care, companion service, cueing and reminding</em></li>\r\n<li><em>Medication management</em></li>\r\n<li><em>Frequent checks for those at risk</em></li>\r\n<li><em>On site physical therapy and visiting physician</em></li>\r\n<li><em>Daily social lifestyle activities </em></li>\r\n<li><em>Exercise and wellness program</em></li>\r\n</ul>\r\n</div>\r\n<p>&nbsp;</p>',1,83,'','','',1),(194,'Sample Menus for a 2000 Calorie Food Pattern cont\'d',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Sample Menus for a 2000 Calorie Food Pattern cont\'d</strong></span></p>',1,61,'sample_menu_2r.jpg','sample_menu','center_top',1),(176,'Where do I go?',0,'txt','<p class=\"Body\" align=\"center\"><strong>Where do I go? </strong></p>\r\n<p align=\"center\"><strong>The Emergency Room? &nbsp; Health Clinic? Urgent Care Center <br></strong></p>\r\n<p align=\"center\">&nbsp;</p>\r\n<p align=\"center\"><strong>Basic Health Tips to Save Your Dollars</strong></p>\r\n<ul>\r\n<li>Base your choice based on the severity of the illness, condition.</li>\r\n<li>Use the Emergency Room for serious conditions, especially if life threatening.&nbsp;</li>\r\n<li>Avoid the Emergency Room for the less serious conditions.</li>\r\n<li>Explore your local health clinics before visiting an Urgent Care Center.&nbsp;</li>\r\n<li>Take care of yourself and your children &ndash; follow the preventive health care habits.</li>\r\n<li>Call a Health Helpline and seek health advice.</li>\r\n</ul>\r\n<p class=\"Body\">&nbsp;</p>\r\n<p class=\"Body\"><strong>When you have a life-threatening situation, such as chest pain or a sudden severe pain, the emergency department of your nearest hospital is your only choice! </strong></p>\r\n<p class=\"Body\">&nbsp;</p>\r\n<p class=\"Body\">If you have any of the following:</p>\r\n<p class=\"Body\" align=\"center\"><strong>CALL 9-1-1 or go to your nearest emergency room!</strong></p>\r\n<p><strong>Emergency Rooms </strong>areequipped to handle even the most critical situations. Emergency Rooms and Trauma Centers are prepared to care for patients at high risk due to illness or injury. &nbsp;Urgent Care Centers are not.&nbsp; &nbsp;If you went to an urgent care clinic, they\'d just send you to the ER in an ambulance.</p>\r\n<p>&nbsp;</p>\r\n<p align=\"center\"><em>Emergency services are available around-the-clock, every day of the year.</em></p>\r\n<p class=\"Body\" align=\"center\"><strong><strong><br clear=\"all\"> </strong></strong></p>',0,84,'urgent_care.jpg','urgent_care','left',1),(177,'Urgent Care Centers',0,'txt','<div class=\"WordSection1\">\r\n<p><strong><span style=\"text-decoration: underline;\">Urgent Care Centers</span></strong> are useful for minor burns or injuries, sprains or strains, coughs and colds, ear infections, fever, rash, mild asthma, animal bites, and minor broken bones. Call ahead and the clinic can advise you if they accommodate your condition otherwise they will direct you to the nearest emergency room. &nbsp;Often urgent care centers are not open on a continuous basis, unlike a hospital emergency department which would be open at all times.</p>\r\n<p class=\"Body\">&nbsp;</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Health Clinics</span></strong><strong> - </strong>local facilities that provide care at no cost or on a sliding scale based on your income. They offer medical care for patients who cannot afford health insurance or are underinsured. These services include adult services which provide patients with medical treatment as well as educational programs and services. In addition, OB/GYN and pediatrics clinics provide an array of quality healthcare services and will assist patients with future family planning needs.</p>\r\n<p><strong>When a Health Clinic or Urgent Care Center can better meet your needs:</strong></p>\r\n</div>\r\n<ul>\r\n<li>Minor burns or injuries</li>\r\n<li>Sprains and strains</li>\r\n<li>Coughs, colds, and sore throats</li>\r\n<li>Ear infections</li>\r\n<li>Allergic reactions (non life-threatening)</li>\r\n<li>Fever or flu-like symptoms</li>\r\n<li>Rash or other skin irritations</li>\r\n<li>Mild asthma</li>\r\n<li>Animal bites</li>\r\n<li>Broken Bones</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><em>And when in doubt, call ahead.</em> If the clinic in question can\'t accommodate your condition, they will advise you to go to the nearest emergency facility.</p>\r\n<p><strong><span style=\"text-decoration: underline;\">Health Care Helpline</span></strong><strong> &ndash; </strong>Often staffed by professional nurses who provide hands-on care and answering questions over the phone.&nbsp; People can call for free information about staying well, assessing symptoms or with questions about a particular illness or disease.</p>',0,85,'xray.jpg','xray','right',1),(178,'Preventive Health Care',0,'txt','<p align=\"center\"><strong>Preventive Health Care</strong></p>\r\n<p align=\"center\">helps avoid trips to the Emergency Room and Health Clinics</p>\r\n<p align=\"center\"><strong><em>Keep the dollars in your pocket!</em></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><em>The most important part of preventive health care is maintaining good health habits</em></strong>.</p>\r\n<p>These include:</p>\r\n<ul>\r\n<li>Daily exercise</li>\r\n<li>Weight control</li>\r\n<li>Proper nutrition</li>\r\n<li>Avoidance of smoking and drug abuse</li>\r\n<li>Abstinence from, or moderation of, alcohol use</li>\r\n<li>Proper control of any diseases or disorders, such as high blood pressure, diabetes, or high levels of cholesterol in the blood</li>\r\n</ul>',1,85,'stethoscope.jpg','stethoscope','left',1),(179,'Affordable Dental Services',0,'txt','<p><strong><em>Broward County Health Department Dental Office wants to be your &ldquo;Provider of Choice&rdquo; for dental services.</em></strong></p>\r\n<p><strong>Accepts many dental plans including:</strong></p>\r\n<ul>\r\n<li class=\"BodyA\">Medicaid * and Medikids</li>\r\n<li class=\"BodyA\">Plans accepted</li>\r\n<li class=\"BodyA\">Florida Healthy Kids</li>\r\n<li class=\"BodyA\">Children&rsquo;s Medical Services</li>\r\n<li class=\"BodyA\">South Florida Community Care Network</li>\r\n<li class=\"BodyA\">Ask for age limit and Medicaid</li>\r\n</ul>\r\n<p class=\"BodyA\"><strong>Dental Services include:</strong></p>\r\n<ul>\r\n<li class=\"BodyA\"><strong>Examinations</strong></li>\r\n<li class=\"BodyA\"><strong>Cleanings</strong></li>\r\n<li class=\"BodyA\"><strong>Tooth Sealants</strong></li>\r\n<li class=\"BodyA\"><strong>Fillings</strong></li>\r\n<li class=\"BodyA\"><strong>Fluoride Treatments</strong></li>\r\n<li class=\"BodyA\"><strong>Simple Extractions</strong></li>\r\n<li class=\"BodyA\"><strong>SAME DAY EMERGENCY VISITS ALSO AVAILABLE</strong></li>\r\n</ul>\r\n<p class=\"BodyA\"></p>\r\n<p class=\"BodyA\"><strong>Children - </strong>(especially those in the Head Start and Early Head Start Programs) - Any child age 4 to 18 years of age who meets the economic eligibility guidelines may receive services; Medicaid is also accepted.</p>\r\n<p class=\"NormalWeb1\"><strong>Ryan White Program - </strong>The Health Department is the lead agency for the Ryan White Care Act Dental Services and provides services at four clinical locations for those who qualify. Three of the sites serve adults and the fourth site serves children under age 18, as well as the caregivers of the child who receives Ryan White services. In addition to clinical services, clients may be referred as necessary to Nova Southeastern University Dental School or the Nova Southeastern University Oral Surgeon at Broward General Medical Center.</p>\r\n<p class=\"BodyA\"><strong>Adults - </strong>The Health Department provides preventive and limited routine dental care for eligible adults referred to the clinic through the Memorial Healthcare System Primary Care Program. The Primary Care Physician makes a referral based on pre-established criteria. The patient referral must come from Memorial Healthcare System Primary Care Program. Preventive and limited routine dental care for eligible adults is also available at the Broward College Dental Clinic.</p>\r\n<p class=\"BodyA\"><strong>Is there a cost for services? - </strong>Services are provided on a sliding scale based on income.&nbsp; Some services are free of charge. The charge for any procedure is decided once all eligibility paperwork is filled out. We also accept patients enrolled in the Children&rsquo;s Medical Services Program and the South Florida Community Care Network.</p>\r\n<p align=\"center\"><strong><em><span style=\"text-decoration: underline;\">Other Dental Service Providers</span></em></strong></p>\r\n<p><strong>Colleges and Universities Dental Clinics - </strong>The Dental Assistant and Hygiene Programs at Colleges offer full services for dental hygiene and limited services for other dental procedures. It is open to the public by appointment only. Clinic hours vary each semester so please call the clinic for information and to schedule an appointment.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Broward County Dental Association - </strong>Provides callers with referrals to qualified dentists in their area who offer both general and specialized services.</p>\r\n<p class=\"BodyA\" style=\"text-align: left;\" align=\"center\"><strong>&nbsp;</strong></p>',5,86,'dental.jpg','dental','center_top',1),(181,'Low Income Home Energy Assistance Program (LIHEAP',0,'txt','<p style=\"text-align: center;\"><strong><span style=\"text-decoration: underline;\">Low Income Home Energy Assistance Program (LIHEAP</span></strong></p>\r\n<p>LIHEAP will help low income residents pay FPL electricity bills.&nbsp; Eligibility is based on family income at or below 150% of the federal poverty level, and regular LIHEAP assistance may be obtained once or twice per year (depending on funding levels).&nbsp; Additional FPL assistance may also be obtained for crisis situations under both LIHEAP and FPL&rsquo;s Care to Share program.&nbsp; Care to share may help some families who are not eligible under LIHEAP.</p>',2,67,'liheap.jpg','liheap','left',1),(184,'Cost',0,'txt','<p><strong><span style=\"text-decoration: underline;\">Costs</span></strong></p>\r\n<ul>\r\n<li><em>Base rent (includes rent, utilities, meals, housekeeping, transportation, laundry service, activities, emergency call system) </em></li>\r\n<li><em>Level of Care (as low as basic wellness monitoring to as high as total care) </em></li>\r\n</ul>\r\n<p><strong><span style=\"text-decoration: underline;\">Financial Assistance</span></strong></p>\r\n<ul>\r\n<li><em>VA aid and attendance</em></li>\r\n<li><em>Medicaid Diversion</em></li>\r\n<li><em>Medicaid waiver</em></li>\r\n</ul>',2,83,'cost_1.jpg','cost','right',1),(201,'Guess what?  You have a second chance!',0,'txt','<p><em>Sometimes it is not a matter of choice.</em>&nbsp; Perhaps, you have made some poor decisions in the past that left you with limited choices.&nbsp;</p>\r\n<p><strong><em>Guess what?&nbsp; You have a second chance!</em></strong>&nbsp; Many lending institutions have second chance programs for banking as long as you demonstrate a commitment to paying back what you owe.&nbsp;</p>\r\n<p>The first step is your willingness to correct the old mistake.&nbsp;</p>',2,78,'second_chance1.jpg','second_chance','right',1),(202,'Credit Report /Credit Bureau FAQ',0,'txt','<p><strong><span style=\"text-decoration: underline;\">Credit Report /Credit Bureau FAQ</span></strong></p>',15,87,'','','',1),(203,'Credit Report /Credit Bureau',0,'txt','<p><strong><span style=\"text-decoration: underline;\">Credit Report /Credit Bureau FAQ</span></strong></p>\r\n<ol start=\"1\">\r\n<li><strong>What is a Credit Bureau?</strong></li>\r\n</ol>\r\n<ul>\r\n<li>A Credit Bureau is simply a clearinghouse for credit history information and only information that&nbsp; relates directly to <em>your</em> credit history can be legally included.</li>\r\n</ul>\r\n<ol start=\"2\">\r\n<li><strong>How do I contact the Credit Bureaus?</strong></li>\r\n</ol>\r\n<ul>\r\n<li>The three largest credit-reporting agencies</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<table border=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Equifax&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</td>\r\n<td>Experian&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>\r\n<td>Trans Union Corporation&nbsp; &nbsp;&nbsp;&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>P.O. Box 740241</p>\r\n<p>Atlanta, GA 30374</p>\r\n<p>(800) 685-1111</p>\r\n<p>www.equifax.com</p>\r\n</td>\r\n<td style=\"text-align: left;\">\r\n<p>P.O. Box 2104</p>\r\n<p>Allen, TX 75013</p>\r\n<p>(888) 397-3742</p>\r\n<p>www.experian.com</p>\r\n</td>\r\n<td>\r\n<p>P.O. Box 390</p>\r\n<p>Springfield, PA 19064</p>\r\n<p>(800) 916-8800</p>\r\n<p>www.transunion.com</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3.&nbsp; What constitutes a credit report?</strong></p>\r\n<ul>\r\n<li>Personal or identifying information</li>\r\n<li>Credit accounts information</li>\r\n<li>Public records information</li>\r\n<li>Inquiries</li>\r\n</ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4. <strong>Is there a cost to obtain a copy of my report?</strong></p>\r\n<ul>\r\n<li>In most States, the cost is $8.&nbsp; However, if you have been denied credit, employment, insurance or rental housing in the past 60 days based on information in your credit files, you are legally entitled to request a copy of your report free of charge. Rates vary for online requests.</li>\r\n</ul>',0,88,'credit_report1.jpg','credit_report','right',1),(204,'What if I find mistakes on my credit report?',0,'txt','<p><strong>&nbsp;5</strong><strong>.&nbsp;&nbsp;&nbsp; </strong><strong>What if I find mistakes on my credit report?</strong></p>\r\n<ul>\r\n<li>Utilize the form included with your credit report to request an investigation and legibly write the company name, account number and the reason for your dispute. By law credit bureaus are required to contact the creditors, notify them of the dispute and provide you with an updated report within 30 days.</li>\r\n</ul>\r\n<p><strong>&nbsp;6.&nbsp;&nbsp;&nbsp; </strong><strong>I have paid off my accounts. Why is my credit report not cleaned up?</strong></p>\r\n<ul>\r\n<li>Even if you have paid off an account completely, delinquencies will remain on your record for seven years; however it should reflect that the account has a zero balance. Bankruptcies remain for 10 years.</li>\r\n</ul>',1,88,'','','',1),(205,'What is a credit score?',0,'txt','<p><span style=\"font-size: small;\"><strong>What is a credit score?</strong></span></p>\r\n<ul>\r\n<li>Credit score is a number based on the information in your credit file that shows how likely you are to pay a loan back on time - the higher your score, the less risk you represent.</li>\r\n<li>The credit score that lenders use is called a FICO score. Your FICO score helps a lender determine whether you qualify for a loan and what interest rate you will pay.</li>\r\n<li>FICO scores are calculated from a lot of different credit data in your credit report</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p>There are many factors affecting credit scores. Below is a breakdown of the major factors and the percentage each category is comprised of.</p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td>Payment History</td>\r\n<td>Previous credit performance</td>\r\n<td>35%</td>\r\n</tr>\r\n<tr>\r\n<td>Amounts Owed</td>\r\n<td>Oustanding Debt</td>\r\n<td>30%</td>\r\n</tr>\r\n<tr>\r\n<td>Types of Credit Used</td>\r\n<td>Credit Mix - Installment/ Revolving loans</td>\r\n<td>10%</td>\r\n</tr>\r\n<tr>\r\n<td>New Credit</td>\r\n<td>Inquiries</td>\r\n<td>10%</td>\r\n</tr>\r\n<tr>\r\n<td>Lentgh Of Credit History</td>\r\n<td>How long accounts have been established</td>\r\n<td>15%</td>\r\n</tr>\r\n</tbody>\r\n</table>',2,88,'credit_score1.jpg','credit_score','right',1),(206,'Understanding the Use of Credit Cards:',0,'txt','<p><span style=\"font-size: small;\"><strong>Understanding the Use of Credit Cards:</strong></span></p>\r\n<p>When you buy something on credit, you take possession of your purchase now and pay for it in the future. At its heart, credit is based on trust - the lender trusts your ability and intent to pay. Credit allows you to buy expensive things, such as a new washer, a car, or even a house, while promising to pay for it from future earnings. Credit can give you access to cash in an emergency, and enable you to consolidate debt to better manage your finances. Consumers today are faced with many choices when it comes to using credit.</p>\r\n<p>&nbsp;</p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\">Common Types of Cards</td>\r\n<td style=\"text-align: center;\">Payment Schedule</td>\r\n<td>Common Uses</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Credit card (revolving open-end charge account)</td>\r\n<td style=\"text-align: center;\">Minimum monthly payments</td>\r\n<td style=\"text-align: center;\">Food, Clothing, Household Items, Dining Out</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Secured Credit Card &nbsp;(requires a cash collateral deposit that becomes the credit line)</td>\r\n<td style=\"text-align: center;\">Minimum monthly payments</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Debit Card with a MasterCard or VISA logo</td>\r\n<td>Payment is deducted directly from account at time of purchase</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>Credit can smooth your finances and improve your standard of living. However, if not used carefully, credit can put you dangerously into debt. Remember: credit is only a substitute for cash. <strong>IT MUST BE PAID BACK &ndash;WITH INTEREST!! </strong></p>\r\n<p><strong>PROS </strong>and <strong>CONS </strong>of using credit:</p>\r\n<p>&nbsp;</p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\">Pros</td>\r\n<td style=\"text-align: center;\">Cons</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">\r\n<p align=\"center\">Immediate use of goods and services</p>\r\n</td>\r\n<td style=\"text-align: center;\">Credit costs money</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Helps to build your credit score</td>\r\n<td style=\"text-align: center;\">Can add cost to purchased goods and services and tempts overspending</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Reservations and purchases by phone or Internet</td>\r\n<td style=\"text-align: center;\">It ties up future Income</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Emergency cash</td>\r\n<td style=\"text-align: center;\">It may result in losses</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Shopping Convenience</td>\r\n<td style=\"text-align: center;\"><em>Shopping Convenience</em></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',11,89,'credit_use1.jpg','credit_use','right',1),(207,'Understanding Your Credit Card Statement',0,'txt','<div>\r\n<p align=\"center\"><strong>Understanding Your Credit Card Statement</strong></p>\r\n<div>\r\n<p align=\"center\">Understanding your monthly credit card statement can help determine whether your spending is in line with your budget.</p>\r\n</div>\r\n<p align=\"center\">By reading and understanding the fine print your statement, you can prevent&nbsp; overspending and become more educated on how your credit card program works</p>\r\n<p align=\"center\">&nbsp;</p>\r\n</div>',11,90,'','','',1),(209,'Credit Card Fees',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Credit Card Fees</strong></span></p>\r\n<p><strong>&nbsp;There are a number of fees to be aware of:</strong></p>\r\n<p><strong>&nbsp;Annual Fee </strong>- An annual fee is what you pay to have a credit card.</p>\r\n<ul>\r\n<li>The amount of the annual fee could vary from card to card.</li>\r\n<li>Some cards that offer benefits such as frequent flyer miles may have a higher fee.</li>\r\n<li>&nbsp;<strong><em>Important to Know:</em></strong>&nbsp; There are cards that have no annual fee and you may be able to find a card that matches your financial needs.</li>\r\n</ul>',0,92,'credit_fee.jpg','credit_fee','left',1),(210,'Late Fee ',0,'txt','<p><strong>Late Fee - </strong>This is a fee you pay the bank or credit card issuer if your monthly payment is received after the due date.</p>\r\n<ul>\r\n<li>The late payment fee will differ, so again, <strong><span style=\"text-decoration: underline;\">do your research</span></strong> and find a credit card that charges the least amount if you happen to be late on a payment.</li>\r\n<li><strong><em>Important to Know</em></strong>:&nbsp; Another bad thing about late payments is that they show up on your credit report.</li>\r\n</ul>\r\n<p><strong>Over Limit Fee &ndash; </strong>Also known as over-the-credit-limit fee.</p>\r\n<ul>\r\n<li>Each credit card has a credit line that is usually found on your lender\'s review of your credit report.</li>\r\n<li><strong><em>Important to Know:</em></strong>&nbsp; If you go over your credit limit a penalty will be assessed each time it happens.</li>\r\n</ul>\r\n<p><strong>Cash Advance Fee</strong><strong> -</strong>This fee is charged if you use your credit card for a cash advance (to get cash directly)</p>\r\n<ul>\r\n<li>This may be a flat fee or a percentage of the cash advance.</li>\r\n<li><strong><em>Important to Know:</em></strong>&nbsp; Some credit cards charge finance charges from the day you get the cash advance without waiting for the grace period</li>\r\n</ul>',1,92,'past_due1.jpg','past_due','right',1),(211,'Tips to Use Your Credit Cards Wisely',0,'txt','<p align=\"center\"><span style=\"font-size: small;\"><strong>Tips to Use Your Credit Cards Wisely</strong></span></p>\r\n<p style=\"text-align: left;\" align=\"center\"><span style=\"font-size: small;\"><span style=\"font-size: x-small;\"></span></span></p>\r\n<ol>\r\n<li><strong>Use only one or two cards</strong>.&nbsp;</li>\r\n<li><strong>Keep track of what you charge</strong>, just as you would with a checking account.</li>\r\n<li><strong>Save for big-ticket items instead of putting them on a card</strong>. If you must borrow for that item, less expensive loans usually are available from banks and credit unions.&nbsp;</li>\r\n<li><strong>Pay credit card bills as soon as they arrive, </strong>to avoid late-payment fees.</li>\r\n<li><strong>It is best to </strong>budget the ability to pay the entire balance on your credit card purchases every month but if that\'s not possible, always pay at least the minimum balance if not more.</li>\r\n<li><strong>If the balance begins to increase</strong>, quit using the card for a while.&nbsp;&nbsp;</li>\r\n<li><strong>Use a low interest rate card, preferably with no annual fee.&nbsp;&nbsp; </strong>Shop around using the internet or look at the offers sent to you in the mail.&nbsp; Rates vary widely.&nbsp; (Retail cards issued by department stores tend to charge the highest rates.)</li>\r\n<li><strong>Be wary of cards that offer extremely low interest rates </strong>\"for a limited time.\" Frequently, when the \"limited\" time expires, a new interest rate is charged and it may be well above average</li>\r\n</ol>',14,93,'credit_card_tips.jpg','card_tips','center_bottom',1),(212,'Earned Income Tax Credit (EITC)',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Earned Income Tax Credit (EITC)</strong></span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: small;\"><span style=\"font-size: x-small;\">The Earned Income Tax Credit (EITC) is a refundable federal income tax credit for low to moderate income working individuals and families.&nbsp; To qualify for Earned Income Tax Credit or EITC or simply called EIC, you must have earned income from employment, self-employment or another source and meet certain rules even if you do not have a filing requirement</span></span></p>\r\n<h3 align=\"center\">Volunteer Income Tax Assistance Program (VITA)</h3>\r\n<h3 align=\"center\">For Free Tax Preparation Services</h3>\r\n<p>The VITA Program offers free tax help to low- to moderate-income (generally, $49,000 and below). IRS Certified volunteers sponsored by various organizations receive training to help prepare basic tax returns. VITA sites are generally located at community and neighborhood centers, libraries, schools, shopping malls, and other convenient locations. Most locations also offer free electronic filing. To locate the nearest VITA site or find out if you qualify for EITC, call 2-1-1 or 954-537-0211 or visit <a href=\"http://www.irs.gov\">www.irs.gov</a>&nbsp; for a Nationwide Free Tax Preparation Site List and other qualifying information</p>\r\n<h3 align=\"center\">Items&nbsp;to bring to the VITA site to have&nbsp;your tax return prepared</h3>\r\n<ul>\r\n<li><strong>Proof of identification</strong></li>\r\n<li><strong>Social Security Cards for you,&nbsp;your spouse and dependents</strong> and/or a Social Security Number verification letter issued by the Social Security Administration</li>\r\n<li>Individual Taxpayer Identification Number (ITIN) assignment letter for you, your spouse and dependents</li>\r\n<li>Proof of foreign status, if applying for an ITIN</li>\r\n<li><strong>Birth dates</strong> for<strong>&nbsp;you, your spouse and&nbsp;dependents on the tax return</strong></li>\r\n<li>Wage and earning statement(s) Form W-2, W-2G, 1099-R, from all employers</li>\r\n<li>Interest and dividend statements from banks (Forms 1099)</li>\r\n<li>A copy of last year&rsquo;s federal and state returns <em>if available</em></li>\r\n<li>Proof of bank account routing numbers and account numbers for Direct Deposit, such as a blank check</li>\r\n<li><strong>Total&nbsp;paid for&nbsp;child care provider and the child care&nbsp;provider\'s&nbsp;tax identifying number&nbsp;(</strong>the provider\'s Social Security Number or the provider\'s business Employer Identification Number)</li>\r\n<li>To file taxes electronically on a married-filing-joint tax return, both spouses must be present to sign the required forms.</li>\r\n</ul>\r\n<p><strong>It is extremely important that each person use the correct Social Security Number.</strong>&nbsp;&nbsp; If you do not have an SSN for you or a dependent, you should complete Form SS-5, Social Security Number Application&nbsp;and submit it to the nearest <a href=\"http://www.irs.gov/app/scripts/exit.jsp?dest=http%3A%2F%2Fwww.ssa.gov%2Fssnumber%2F\">Social Security Administration Office</a>. If you or your dependent is not eligible to get a Social Security Number, you may need an <a href=\"http://www.irs.gov/individuals/article/0,,id=96287,00.html\">Individual Taxpayer Identification Number (ITIN).</a>&nbsp; Please visit <a href=\"http://www.irs.gov\">www.irs.gov</a>&nbsp; for more information on the ITIN.</p>\r\n<p align=\"center\">For information on who qualifies for the EITC or to find a free Volunteer Income Tax Assistance (VITA) site, call 2-1-1 or 954-537-0211.</p>',15,94,'eitc1.jpg','eitc','left',1),(213,'Creating a budget',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>Creating a budget</strong></span></p>\r\n<p>A Monthly Budget Guide is one of the most important tools to good money management. It is a simple aid created to give you an overview of your current economic situation and a glimpse of your foreseeable future.</p>\r\n<p align=\"center\"><strong><span style=\"text-decoration: underline;\">70-20-10 rule</span></strong></p>\r\n<p align=\"center\"><strong><strong><em>A good way to keep debt in check is to follow the 70-20-10 rule.</em></strong></strong></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\">70%</td>\r\n<td style=\"text-align: center;\">20%</td>\r\n<td style=\"text-align: center;\">10%</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>Living Expenses</strong></td>\r\n<td style=\"text-align: center;\"><strong><strong>Savings or Investment</strong></strong></td>\r\n<td style=\"text-align: center;\"><strong>Debt Payments</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">\r\n<p align=\"center\"><strong>Housing Expenses (Rent/Mortgage, etc.)</strong></p>\r\n<p align=\"center\"><strong>Food</strong></p>\r\n<strong>Gasoline</strong></td>\r\n<td style=\"text-align: center;\">\r\n<p align=\"center\"><strong>Financial Goals</strong></p>\r\n<strong>Emergency Expenses</strong></td>\r\n<td style=\"text-align: center;\">\r\n<p align=\"center\"><strong>Credit Cards</strong></p>\r\n<strong>Loans</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><strong>1. Gather every financial statement you can.</strong></p>\r\n<p>â–¡&nbsp; bank statements</p>\r\n<p>â–¡&nbsp; investment accounts</p>\r\n<p>â–¡&nbsp; recent utility bills</p>\r\n<p>â–¡&nbsp; any information regarding a source of&nbsp; expense</p>\r\n<p>&nbsp;The key for this process is to create a monthly average so the more information you can dig up the better.</p>\r\n<p><strong>2. Record all of your sources of income. </strong></p>\r\n<p>â–¡&nbsp; self-employed</p>\r\n<p>â–¡&nbsp; any outside sources of income like child support</p>\r\n<p>&nbsp;If your income is in the form of a regular paycheck where taxes are automatically deducted then using the net income, or take home pay, amount is fine.</p>\r\n<p><strong>3. Create a list of all monthly expenses - all the expected expenses you have over the course of a month. </strong></p>\r\n<p>â–¡&nbsp; mortgage payment</p>\r\n<p>â–¡&nbsp; car payments</p>\r\n<p>â–¡&nbsp; auto insurance</p>\r\n<p>â–¡&nbsp; groceries</p>\r\n<p>â–¡&nbsp; utilities</p>\r\n<p>â–¡&nbsp; entertainment</p>\r\n<p>â–¡&nbsp; dry cleaning</p>\r\n<p>â–¡&nbsp; retirement</p>\r\n<p>â–¡&nbsp; college savings</p>\r\n<p><strong>4. Total your monthly income and monthly expenses.</strong></p>\r\n<p>&nbsp;If your end result shows more income than expenses you are off to a good start. This means you can prioritize this excess to areas of your budget such as retirement savings or paying more on credit cards to eliminate that debt faster. If you are showing a higher expense column than income it means some changes will have to be made</p>\r\n<p><strong>5. Make adjustments to expenses. The ultimate goal would be to have your income and expense columns equal. This means all of your income is accounted for and budgeted for a specific expense. </strong></p>',16,95,'create_budget1.jpg','create_budget','right',1),(214,'Working with Your Budget',0,'txt','<p><span style=\"font-size: small;\"><strong>Step 4:</strong>&nbsp; <strong>Working with Your Budget</strong></span></p>\r\n<p>Find a method for keeping track of your budget that</p>\r\n<p>&nbsp;</p>\r\n<p align=\"center\"><strong>The Envelope System</strong></p>\r\n<p>Label envelopes with each of your expense categories.&nbsp; When you get money, separate it into the different envelopes based on the expense amounts in your budget.&nbsp; When you need money, take it from the envelope.&nbsp; When there is no more money in the envelope you have spent your budgeted amount from that category. For safety you can use play money or index cards with dollar amounts written on them.</p>\r\n<p align=\"center\"><strong>The Tally System</strong></p>\r\n<p>You keep a list of your spending and save all receipts.&nbsp; At the end of the day or week you enter the amounts of the expenses under each category.&nbsp; Then you subtract to find out how much you still have available .</p>\r\n<p style=\"text-align: center;\"><strong>Checking Account Register</strong></p>\r\n<p>Write all income and expenses on your checking account register even if you paid cash.</p>\r\n<p style=\"text-align: center;\"><strong>Electronic Spreadsheet</strong></p>\r\n<p>Create a worksheet with all your expenses and income.&nbsp; The benefit is that you can have the spreadsheet software do the calculations for you.</p>\r\n<p style=\"text-align: center;\"><strong>Personal Finance Software</strong></p>\r\n<p>This software will help you monitor your money in several accounts at one time.&nbsp; It can give you more information to make better decisions</p>\r\n<p><strong>Review your budget monthly. It is important to review your budget on a regular basis to make sure you are staying on track. After the first month take a minute to sit down and compare the actual expenses versus what you had created in the budget. This will show you where you did well and where you may need to improve</strong></p>',17,96,'','','',1),(215,'Emergency',0,'txt','<p class=\"Body\"><strong>When you have a life-threatening situation, such as chest pain or a sudden severe pain, the emergency department of your nearest hospital is your only choice! </strong></p>\r\n<p class=\"Body\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',1,84,'emergency.jpg','emergency ','right',1),(216,'CALL 9-1-1 ',0,'txt','<p><strong>Emergency Rooms </strong>areequipped to handle even the most critical situations. Emergency Rooms and Trauma Centers are prepared to care for patients at high risk due to illness or injury. &nbsp;Urgent Care Centers are not.&nbsp; &nbsp;If you went to an urgent care clinic, they\'d just send you to the ER in an ambulance.</p>\r\n<p>&nbsp;</p>\r\n<p align=\"center\"><em>Emergency services are available around-the-clock, every day of the year.</em></p>',2,84,'loss_consciousness.jpg','loss_consciousness','center_top',1),(217,'Proper Dental Care',0,'txt','<p><strong>Good oral hygiene</strong> results in a mouth that looks and smells healthy. This means:</p>\r\n<ul>\r\n<li>Your teeth are clean and free of debris</li>\r\n<li>Gums are pink and do not hurt or bleed when you brush or floss</li>\r\n<li><a href=\"http://www.colgate.com/app/CP/US/EN/OC/Information/Glossary/Bad-Breath.cvsp\">Bad breath</a> is not a constant problem</li>\r\n</ul>\r\n<p>If your gums do hurt or bleed while <a href=\"http://www.colgate.com/app/CP/US/EN/OC/Information/Glossary/Brushing.cvsp\">brushing</a> or <a href=\"http://www.colgate.com/app/CP/US/EN/OC/Information/Articles/Oral-and-Dental-Health-Basics/Oral-Hygiene/Brushing-and-Flossing/article/How-to-Floss.cvsp\">flossing</a>, or you are experiencing persistent bad breath, see your dentist. Any of these conditions may indicate a problem. </p>\r\n<p>Daily preventive care, including proper brushing and flossing, will help stop problems before they develop and is much less painful, expensive, and worrisome than treating conditions that have been allowed to progress.</p>\r\n<p>In between regular visits to the dentist, there are simple steps that each of us can take to greatly decrease the risk of developing <a href=\"http://www.colgate.com/app/CP/US/EN/OC/Information/Glossary/Tooth-Decay.cvsp\">tooth decay</a>, <a href=\"http://www.colgate.com/app/CP/US/EN/OC/Information/Articles/Oral-and-Dental-Health-Basics/Common-Concerns/Gum-Disease/article/What-are-the-Stages-of-Gum-Disease.cvsp\">gum disease</a> and other dental problems. These include:</p>\r\n<ul>\r\n<li>Brushing thoroughly twice a day and flossing daily</li>\r\n<li>Eating a balanced diet and limiting snacks between meals</li>\r\n<li>Using dental products that contain <a href=\"http://www.colgate.com/app/CP/US/EN/OC/Information/Glossary/Fluoride.cvsp\">fluoride</a>, including toothpaste</li>\r\n<li>Rinsing with a fluoride mouth rinse if your dentist tells you to</li>\r\n<li>Making sure that your children under 12 drink fluoridated water or take a fluoride supplement if they live in a non-fluoridated area</li>\r\n</ul>',0,97,'tooth_care.jpg','tooth_care','right',1),(218,'Proper Brushing Technique',0,'txt','<p align=\"center\"><strong><span style=\"text-decoration: underline;\">Proper Brushing Technique</span></strong></p>',1,97,'brushing_technique.jpg','brushing','center_bottom',1),(219,'Health History Questionnaire',0,'txt','<div class=\"WordSection1\">\r\n<p align=\"center\"><strong>Health History Questionnaire</strong></p>\r\n<p align=\"center\">(Take this with you to the Doctor)</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Name:<span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong>&nbsp;&nbsp;</p>\r\n<p><strong>Date of Birth:</strong><span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Medical Doctor</strong>:&nbsp;&nbsp; <span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&nbsp;&nbsp; Phone:<span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p><strong>Heart Doctor:</strong> &nbsp;&nbsp;&nbsp;&nbsp; <span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&nbsp;&nbsp; Phone:<span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p><strong>Other Doctor:</strong> &nbsp;&nbsp;&nbsp;&nbsp; <span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>&nbsp;&nbsp; Phone:<span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p>&nbsp;</p>\r\n<p align=\"center\"><strong><span style=\"text-decoration: underline;\">Medical History</span></strong></p>\r\n<p>&nbsp;</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"WordSection2\">\r\n<p>____ High Blood Pressure</p>\r\n<p>____Diabetes</p>\r\n<p>____ Kidney problems</p>\r\n<p>____ Heart Attack</p>\r\n<p>____ Stroke</p>\r\n<p>____ Asthma</p>\r\n<p>____ Seizures</p>\r\n<p>____ Anxiety/Depression</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>____ Cancer:<span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p>____Breathing Problems:<span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p>____Bleeding Problems:<span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p>____Digestive Problems:<span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Allergies:<span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Medication List:</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></strong><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style=\"text-decoration: underline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&n',7,98,'','','',1),(220,'High Blood Pressure',0,'txt','<p class=\"Body\"><strong>High Blood Pressure</strong></p>\r\n<p class=\"Body\">&nbsp;Is a condition when the pressure of the blood pumping is abnormally high.</p>\r\n<p class=\"Body\">&nbsp;A person&rsquo;s blood pressure consists of two numbers:</p>\r\n<ul>\r\n<li>the top number or systolic is the heart squeezing and</li>\r\n<li>the bottom number is the diastolic which is the pressure when the heart relaxes.</li>\r\n<li>A normal blood pressure is less than 120/80.</li>\r\n</ul>\r\n<p class=\"Body\"><strong><em>&nbsp;High blood pressure is also referred to as &ldquo;hypertension.&rdquo;</em></strong></p>',8,99,'','','',1),(221,'Symptoms',0,'txt','<p class=\"Body\" align=\"center\"><strong>Symptoms</strong></p>\r\n<p class=\"Body\">There are usually <strong><span style=\"text-decoration: underline;\">no symptoms</span></strong> with high blood pressure. <strong>Very high blood</strong> <strong>pressures</strong> may have symptoms that include:</p>\r\n<ul>\r\n<li><strong>headache,</strong></li>\r\n<li><strong>dizziness</strong></li>\r\n<li><strong>blurry vision</strong></li>\r\n<li><strong>nausea and vomiting </strong></li>\r\n<li><strong>chest pain</strong></li>\r\n<li><strong>shortness of breath</strong></li>\r\n</ul>\r\n<p class=\"Body\">&nbsp;Long periods of hypertension may lead to other organs being affected and possibly organ failure.</p>\r\n<p class=\"Body\" align=\"center\"><strong>In an emergency</strong></p>\r\n<p class=\"Body\">Usually the first symptom is chest pain or stroke-like symptoms. <strong>9-1-1 should be called immediately. </strong></p>\r\n<p class=\"Body\">If your blood pressure is high, follow-up may be needed at your doctor&rsquo;s office or clinic for medications or education about diet.</p>\r\n<p class=\"Body\" align=\"center\"><strong>What can I do?</strong></p>\r\n<p class=\"Body\">Limiting salt intake, losing weight, and increasing physical activity are ways to help lower your blood pressure. Smoking and alcohol should be limited.</p>\r\n<p class=\"Body\">If lifestyle changes do not lower the blood pressure, medications may be needed.</p>',8,100,'heart_pressure.jpg','heart_pressure','left',1),(222,'Warning Signs of a Stroke',0,'txt','<p style=\"text-align: center;\"><strong>Warning Signs of a Stroke</strong></p>\r\n<p style=\"text-align: left;\"></p>\r\n<p class=\"Body\">SUDDEN <strong>trouble walking, dizziness</strong>, loss of balance</p>\r\n<p class=\"Body\">SUDDEN <strong>numbness or weakness</strong> of</p>\r\n<p class=\"Body\">SUDDEN <strong>trouble seeing</strong> in one or both eyes</p>\r\n<p class=\"Body\">face, arm or leg-especially on one side of the body</p>\r\n<p class=\"Body\">SUDDEN <strong>confusion, trouble speaking</strong> or understanding</p>',0,101,'','','',1),(223,'SUDDEN severe headache with no known cause',0,'txt','<p>&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;</p>\r\n<p class=\"Body\" align=\"center\">&nbsp;<strong><span style=\"text-decoration: underline;\">In An Emergency</span></strong></p>\r\n<p class=\"Body\" align=\"center\"><strong>CALL 9-1-1 IMMEDIATELY IF YOU HAVE <span style=\"text-decoration: underline;\">ANY</span> OF THESE SYMPTOMS NOTE THE TIME THE SYMPTOMS FIRST STARTED!</strong></p>',1,101,'fast.jpg','fast','left',1),(224,'What is Breast Cancer?',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>What is Breast Cancer?</strong></span></p>\r\n<p>It is a malignant tumor that has developed from the cells in the breast, usually in the tubes that carry milk or the glands that make milk.</p>\r\n<p align=\"center\"><strong><em><span style=\"text-decoration: underline;\">Each Year</span></em></strong><strong><em> Breast Cancer Affects So Many Lives</em></strong></p>\r\n<p>230,480 cases in <strong>WOMEN&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>2,140 cases in <strong>MEN&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>Over39,520 <strong>Lives Destroyed</strong></p>\r\n<p><strong>Risk Factors</strong></p>\r\n<ul>\r\n<li>Family history of breast cancer</li>\r\n<li>Alcohol use</li>\r\n<li>Poor diet</li>\r\n<li>Age</li>\r\n<li>Weight</li>\r\n<li>Reproduction and menstrual history</li>\r\n</ul>',10,102,'','','',1),(225,'Breast Cancer',0,'txt','<p class=\"Body\" align=\"center\"><strong>&nbsp;<span style=\"font-size: small;\">What is Breast Cancer?</span></strong></p>\r\n<p class=\"Body\" style=\"text-align: left;\" align=\"center\"><span style=\"font-size: x-small;\">It is a malignant tumor that has developed from the cells in the breast, usually in the tubes that carry milk or the glands that make milk</span></p>\r\n<p style=\"text-align: left;\" align=\"center\"><strong><em><span style=\"text-decoration: underline;\">Each Year</span></em></strong><strong><em> Breast Cancer Affects So Many Lives</em></strong></p>\r\n<p>230,480 cases in <strong>WOMEN</strong></p>\r\n<p>2,140 cases in <strong>MEN</strong></p>\r\n<p>Over39,520 <strong>Lives Destroyed</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Risk Factors</strong></p>\r\n<ul>\r\n<li>Family history of breast cancer</li>\r\n<li>Alcohol use</li>\r\n<li>Poor diet</li>\r\n<li>Age</li>\r\n<li>Weight</li>\r\n<li>Reproduction and menstrual history</li>\r\n</ul>',0,103,'','','',1),(226,'Minimize your Risk',0,'txt','<p class=\"Body\"><strong>Minimize your Risk</strong></p>\r\n<ul>\r\n<li>Do the self-breast exam <span style=\"text-decoration: underline;\">every month</span> beginning at age 20.</li>\r\n<li>if you are over 40, Each year you should:</li>\r\n<li>Have a &nbsp;mammogram</li>\r\n<li>Have your doctor do a breast exam</li>\r\n<li>Don&rsquo;t panic if you find a lump. Most women have lumps in their breasts all the time.</li>\r\n<li>You may want to start a journal to record the findings of your self-exams.</li>\r\n<li>Only changes that last beyond one full cycle or seem to get bigger or more prominent in some way need your doctor&rsquo;s attention.</li>\r\n<li>Other Diagnostic Tools: Ultrasound, MRI, Biopsy and Hormone Receptors</li>\r\n</ul>',1,103,'breast_exam.jpg','breast_exam','left',1),(227,'Signs and Symptoms ',0,'txt','<p class=\"Body\"><strong>Signs and Symptoms </strong></p>\r\n<ul>\r\n<li>You feel something hard on the breasts or under your arms</li>\r\n<li>Nipple discharge or tenderness, or it pulls back into the breast</li>\r\n<li>The skin looks orange, the nipples feel swollen, red and scaly</li>\r\n</ul>',2,103,'pink_ribbon.jpg','pink_ribbon','right',1),(228,'Depression Signs and Symptoms',0,'txt','<div class=\"WordSection1\">\r\n<p class=\"Body\" align=\"center\"><strong>Depression</strong> <strong>Signs and Symptoms</strong></p>\r\n<p class=\"Body\">It\'s normal to feel some of the following symptoms from time to time, but experiencing several for more than two or three weeks may indicate the presence of depression or another depressive illness.</p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"WordSection2\">\r\n<ul>\r\n<li class=\"Body\">I feel sad.</li>\r\n<li class=\"Body\">I feel like crying a lot.</li>\r\n<li class=\"Body\">I\'m bored.</li>\r\n<li class=\"Body\">I feel alone.</li>\r\n<li class=\"Body\">I don\'t really feel sad, just \"empty\".</li>\r\n<li class=\"Body\">I don\'t have confidence in myself.</li>\r\n<li class=\"Body\">I don\'t like myself.</li>\r\n<li class=\"Body\">I often feel scared, but I don\'t know why.</li>\r\n<li class=\"Body\">I feel mad, like I could just explode!</li>\r\n<li class=\"Body\">I feel guilty.</li>\r\n<li class=\"Body\">I can\'t concentrate.</li>\r\n<li class=\"Body\">I have a hard time remembering things.</li>\r\n<li class=\"Body\">I don\'t want to make decisions - it\'s too much work.</li>\r\n<li class=\"Body\">I feel like I\'m in a fog.</li>\r\n<li class=\"Body\">I\'m so tired, no matter how much I sleep.</li>\r\n<li class=\"Body\">I\'m frustrated with everything and everybody.</li>\r\n<li class=\"Body\">I don&rsquo;t have fun anymore.</li>\r\n<li class=\"Body\">I feel helpless.</li>\r\n<li class=\"Body\">I\'m always getting into trouble.</li>\r\n<li class=\"Body\">I\'m restless and jittery. I can&rsquo;t sit still.</li>\r\n<li class=\"Body\">I feel nervous.</li>\r\n<li class=\"Body\">I feel disorganized, like my head is spinning.</li>\r\n<li class=\"Body\">I feel self-conscious.</li>\r\n<li class=\"Body\">I can\'t think straight. My brain doesn\'t seem to work.</li>\r\n<li class=\"Body\">I feel ugly.</li>\r\n<li class=\"Body\">I don&rsquo;t feel like talking anymore - I just don&rsquo;t have anything to say.</li>\r\n<li class=\"Body\">I feel my life has no direction.</li>\r\n<li class=\"Body\">I feel life isn&rsquo;t worth living.</li>\r\n<li class=\"Body\">I consume alcohol/take drugs regularly.</li>\r\n<li class=\"Body\">My whole body feels slowed down - my speech, my walk, and my movements.</li>\r\n<li class=\"Body\">I don\'t want to go out with friends anymore.</li>\r\n<li class=\"Body\">I don\'t feel like taking care of my appearance.</li>\r\n<li class=\"Body\">Occasionally, my heart pounds, I can\'t catch my breath, and I feel tingly.</li>\r\n<li class=\"Body\">My vision feels strange and I feel I might pass out. The feeling passes in seconds, but I\'m afraid it will happen again.</li>\r\n<li class=\"Body\">Sometimes I feel like I\'m losing it.</li>\r\n<li class=\"Body\">I feel \"different\" from everyone else.</li>\r\n<li class=\"Body\">I smile, but inside I\'m miserable.</li>\r\n<li class=\"Body\">I have difficulty falling asleep or I awaken between 1 A.M. and 5 A.M. and then I can\'t get back to sleep.</li>\r\n<li class=\"Body\">My appetite has diminished - food tastes so bland.</li>\r\n<li class=\"Body\">My appetite has increased - I feel I could eat all the time.</li>\r\n<li class=\"Body\">My weight has increased/decreased.</li>\r\n<li class=\"Body\">I have headaches.</li>\r\n<li class=\"Body\">I have stomachaches.</li>\r\n<li class=\"Body\">My arms and legs hurt.</li>\r\n<li class=\"Body\">I feel nauseous.</li>\r\n<li class=\"Body\">I\'m dizzy.</li>\r\n<li class=\"Body\">Sometimes my vision seems blurred or slow.</li>\r\n<li class=\"Body\">I\'m clumsy.</li>\r\n<li class=\"Body\">My neck hurts.</li>\r\n</ul>\r\n<p class=\"Body\">&nbsp;</p>\r\n</div>\r\n<p class=\"Body\" align=\"center\"><strong><em>Remember, you must seek a professional for an accurate diagnosis of depression. </em></strong></p>\r\n<p><em>This checklist is provided only as a tool to help you talk with your doctor or treatment provider about your concerns and develop an action plan for successful recovery</em></p>',11,104,'depression_sign.jpg','depression','right',1),(229,'Warning Signs of Suicide ',0,'txt','<div class=\"WordSection1\">\r\n<p align=\"center\"><strong>A suicidal person urgently needs to see a doctor or mental health professional</strong></p>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"WordSection2\">\r\n<ul>\r\n<li>Ideation (thinking about suicide)</li>\r\n<li>Substance use or abuse (increased or change in substance)</li>\r\n<li>Purposelessness (no sense of purpose or belonging)</li>\r\n<li>Anger</li>\r\n<li>Trapped (feeling like there is no way out)</li>\r\n<li>Hopelessness (there is nothing to live for, no hope or optimism)</li>\r\n<li>Withdrawal (from family, friends, work, school, activities, hobbies)</li>\r\n<li>Anxiety (restlessness, irritability)</li>\r\n<li>Recklessness (high risk-taking behavior)</li>\r\n<li>Mood disturbance (dramatic change in mood)</li>\r\n<li>Talking about suicide</li>\r\n<li>Statements about hopelessness, helplessness, or worthlessness</li>\r\n<li>Preoccupation with death</li>\r\n<li>Loss of interest in things one cares about</li>\r\n<li>Visiting or calling people one cares about.</li>\r\n<li>Making arrangements; setting one\'s affairs in order</li>\r\n<li>Giving things away, such as prized possessions</li>\r\n</ul>\r\n<p class=\"Body\"><strong><em>WARNING:&nbsp; watch out for the depressed person who exhibits a sudden, intense lift in spirits!&nbsp; </em></strong><em>This may indicate he/she has already made the decision to commit suicide, and no longer feels distress over the idea.</em></p>\r\n<p class=\"Body\" style=\"text-align: left;\" align=\"center\">&nbsp;</p>\r\n<div class=\"WordSection1\">\r\n<p class=\"Body\" align=\"center\"><strong><span style=\"text-decoration: underline;\">Tips on Dealing with a Suicidal Person</span></strong></p>\r\n<p class=\"Body\"><strong>Find out:</strong></p>\r\n</div>\r\n<ul>\r\n<li><em>Reasons for living</em></li>\r\n<li><em>Coping beliefs</em></li>\r\n<li><em>Responsibility to family</em></li>\r\n<li><em>Moral/religious objections</em></li>\r\n<li><em>Fear of messing up the suicide and being worse off</em></li>\r\n<li><em>Risk factors</em></li>\r\n<li><em>Support system</em></li>\r\n<li><em>Willingness to accept psychiatric or psychological treatment</em></li>\r\n<li><em>Substance abuse issues</em></li>\r\n<li><em>Strengths and weaknesses</em></li>\r\n</ul>\r\n<p class=\"Body\" style=\"text-align: left;\" align=\"center\"><strong><span style=\"text-decoration: underline;\">&nbsp;</span></strong></p>\r\n</div>',0,105,'','','',1),(230,'Remember Suicide:',0,'txt','<div class=\"WordSection1\">\r\n<p class=\"Body\"><strong>Remember:</strong></p>\r\n<ul>\r\n<li>When someone tells you they are thinking about suicide, just tell them directly &ldquo;Don&rsquo;t Do It&rdquo;, even before you ask questions about plan or motive.</li>\r\n<li>Discouraging a parent from suicide for the sake of his/her young children can be a double-edged sword.&nbsp; It can be the best way to dissuade someone, but in rare cases, it can get the parent to consider taking the children with him/her.</li>\r\n<li>Gather information from all the sources (family, friends, neighbors).</li>\r\n<li>If the person is actively suicidal, don&rsquo;t leave him/her alone.&nbsp; Once you&rsquo;ve begun an intervention, don&rsquo;t stop until help arrives.</li>\r\n<li>Acknowledge emotions.</li>\r\n<li>Express your willingness to help.</li>\r\n<li>Provide a support network.</li>\r\n<li>Give them different options to combat hopelessness.</li>\r\n<li>Ask to dispose of any weapons.</li>\r\n<li>Don&rsquo;t give false assurances.</li>\r\n<li>Don&rsquo;t rely on a &ldquo;No Suicide Contract&rdquo; as a quick solution to suicidality.&nbsp; Such contracts have no real predictive value , and are of limited effectiveness in preventing suicide</li>\r\n<li>Know Baker Act criteria.</li>\r\n<li>Document everything you say and do with the person.</li>\r\n<li>Stay as calm as you can&hellip;</li>\r\n</ul>\r\n</div>\r\n<p>&nbsp;</p>\r\n<div class=\"WordSection2\">&nbsp;</div>',1,105,'remember_suicide.jpg','suicide','right',1),(231,'Tips for increasing Physical Activity',0,'txt','<p align=\"center\"><strong>Make physical activity a regular part of the day</strong></p>\r\n<p>Choose activities that you enjoy and can do regularly.&nbsp; Fitting activity into a daily routine can be easy &ndash; such as taking a brisk 10 minute walk to and from the&nbsp; parking lot or bus stop.&nbsp; Or join an exercise class.&nbsp; Keep it interesting by trying something different on alternate days.&nbsp; Every little bit adds up and doing something is better than doing nothing.&nbsp; Be sure to do at least 10 minutes of activity at a time.Shorter bursts of activity will not have the same health benefits</p>\r\n<p><strong>At Home:</strong></p>\r\n<ul>\r\n<li>Join a walking group in the neighborhood or local shopping mall.</li>\r\n<li>Recruit a partner for support or encouragement.</li>\r\n<li>Get the whole family involved &ndash; enjoy an afternoon bike ride with your kids.</li>\r\n<li>Walk up and down the sports field while watching the kids play.</li>\r\n<li>Do stretches or other exercises while watching TV.</li>\r\n<li>Drive less.</li>\r\n<li>Plant and care for a garden.</li>\r\n</ul>\r\n<p><strong>At Work:</strong></p>\r\n<ul>\r\n<li>Replace a coffee break with a brisk 10 minute walk.</li>\r\n<li>Park at the far end of the parking lot.</li>\r\n<li>Take part in an exercise program at work.</li>\r\n<li>Join the office sports team or walking group.</li>\r\n</ul>\r\n<p><strong>At Play:</strong></p>\r\n<ul>\r\n<li>Walk, jog, skate or cycle.</li>\r\n<li>Swim or do water aerobics.</li>\r\n<li>Take a class in martial arts, dance, or yoga.</li>\r\n<li>Canoe, row or kayak.</li>\r\n<li>Hand cycle or play wheelchair sports.</li>\r\n<li>Take a nature walk.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p align=\"center\"><strong><em>Most important &ndash; have fun while being active!</em></strong></p>',13,106,'yoga.jpg','yoga','right',1),(232,'Active Play',0,'txt','<p align=\"center\"><strong><em>Why is active play important?</em></strong></p>\r\n<div>\r\n<p><strong>Active play helps your child learn healthy habits.&nbsp; There are many health benefits of active play, such as:</strong></p>\r\n</div>\r\n<div>\r\n<ul>\r\n<li>Active children are less likely to be overweight.</li>\r\n<li>Keeping your child active now helps lower the chance of developing chronic diseases like Type 2 diabetes later.</li>\r\n<li>Activities, like running and jumping rope, help your child learn movement skills to develop muscles and strong bones.</li>\r\n<li>Active plan can also help the mind develop.&nbsp; Playing &ldquo;pretend&rdquo; lets kids be creative.</li>\r\n<li>Active children are more likely to be happy and feel good about themselves.&nbsp; Children feel proud after learning how to bounce a ball or ride a bike.</li>\r\n<li>Your child loves to move!</li>\r\n</ul>\r\n<ul>\r\n<li>Encourage your child to play actively several times each day.&nbsp; Short bursts of time are OK.&nbsp;</li>\r\n</ul>\r\n<ul>\r\n<li>Make active play fun for the whole family.&nbsp;</li>\r\n</ul>\r\n<ul>\r\n<li>Let your child help plan the fun.</li>\r\n</ul>\r\n<ul>\r\n<li>Focus on fun, not performance.&nbsp;</li>\r\n<li>Set limits on TV and computer time.&nbsp;</li>\r\n</ul>\r\n<p align=\"center\"><strong><em>There are many activities you can do with your child</em></strong></p>\r\n<table style=\"width: 599px; height: 122px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td valign=\"top\" width=\"334\">\r\n<p align=\"center\"><strong><span style=\"text-decoration: underline;\">Indoor Play</span></strong></p>\r\n<ul>\r\n<li>Act out a story.</li>\r\n<li>Turn up the music and dance.</li>\r\n<li>Walk inside a shopping mall.</li>\r\n<li>Play games, such as duck-duck-goose, hide and seek, follow the leader, Simon Says.</li>\r\n</ul>\r\n</td>\r\n<td valign=\"top\" width=\"334\">\r\n<p align=\"center\"><strong><span style=\"text-decoration: underline;\">Outdoor Play</span></strong></p>\r\n<ul>\r\n<li>Walk after dinner with your family.</li>\r\n<li>Play catch.</li>\r\n<li>Take a nature hike.</li>\r\n<li>Play games in the yard or park.</li>\r\n<li>Kick a ball.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>',14,107,'play_sports.jpg','play_sports','center_top',1),(233,'Daily Fitness Log',0,'txt','<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n<p style=\"text-align: center;\"><strong>Daily Fitness Log</strong></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: x-small;\"><strong><strong>Exercise may improve health by helping the brain cope with stress</strong></strong></span></p>\r\n<p align=\"center\">American Psychological Association</p>\r\n<p>&nbsp;Exercise controls weight, prevents diseases, reduces stress, increases energy, promotes sleep and helps you connect with family and friends.&nbsp; <strong>What can exercise do for</strong> <strong>you?</strong>&nbsp; <strong>Success</strong> depends on choosing an activity you enjoy.&nbsp; Walking, running or cycling 30 minutes a day.&nbsp; Make a <strong>commitment</strong> with a friend to ensure victory.&nbsp; Always check with your physician before starting an exercise program.</p>\r\n<p align=\"center\"><span style=\"text-decoration: underline;\">General Info</span></p>\r\n<p style=\"text-align: left;\" align=\"center\">Current Weight:</p>\r\n<p style=\"text-align: left;\" align=\"center\">Goal Weight:</p>\r\n<p style=\"text-align: left;\" align=\"center\">Resting Heart Rate:</p>\r\n<p style=\"text-align: left;\" align=\"center\">(To check heart rate place two fingers on thumb side of wrist and count for 10 seconds and multiply by 6. Your heart rate should be between 60 to 100.)</p>\r\n<p align=\"center\"><span style=\"text-decoration: underline;\">Time Sheet</span></p>\r\n<table border=\"1\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">Activity</td>\r\n<td style=\"text-align: center;\">Rest Day or Time spent exercising</td>\r\n<td style=\"text-align: center;\">Heart Rate after exercise</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Sunday</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Monday</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Tuesday</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Wednesday</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Thursday</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Friday</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">Saturday</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n<td style=\"text-align: center;\">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p align=\"center\">&nbsp;</p>\r\n<p style=\"text-align: left;\" align=\"center\">&nbsp;</p>',15,108,'active_play.jpg','active_play','left',1),(234,'My Activity Log',0,'txt','<p style=\"text-align: center;\"><span style=\"font-size: small;\"><strong>My Activity Log</strong></span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>',16,109,'activity_log.jpg','activity_log','center_bottom',1);
